(59, 401, 'garima sharma', 388, 1, 236, 0, 0, '10', 1, 'enquiry_pending', '2021-10-28 10:27:23', '2021-10-28 10:27:24', '2021-10-28 00:00:00', '2021-10-28', '{\"property\":{\"property_title\":\"Mare Street Studios\",\"property_id\":\"1\",\"short_description\":\"Sophisticated high-rise modern buildings built above the famous Mare Street Studios of House of Cards fame.\\r\\nA very well known location within a stone throw of the corridors of power, this building was once the HQ of the Anglo Iranian Oil Company.\\r\\nJoin technology, investment and commodity trading business who benefit from the Gigabit networks rooted to all floors. \\r\\nAll rooms have access to facilities 24 hours bookable through the floor receptions. Fully access controlled 24\\/365, this property is geared for businesses who see infrastructure resilience as paramount.\",\"property_type\":\"Short-Term\",\"description\":null,\"property_total_desk\":20,\"property_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/611362e96dc2410.jpg\",\"property_approved_status\":\"publish\",\"avg_rating\":3,\"disability_access\":true,\"describe_your_space\":\"\",\"how_to_find_us\":\"We like people and understand that happy, connected, safe people are productive. And of course they come back.\\r\\nOur ethos is simple, we make your stay enjoyable and treat you as if you are part of the family.\",\"insurance\":\"20M Public liability\",\"covid_19_secure\":\"Part of the benefit of being in the Mike Ashley Property Group is our access to their world class laundry team.\",\"londload_name\":\"Liz Scott\",\"user_name\":\"garima sharma\",\"postcode\":\"8754710\",\"address\":\"203\\/213 Mare Street\",\"city\":\"london\",\"state\":\"london\",\"country\":\"United Kingdom\",\"longitude\":\"-0.055161499733186854\",\"latitude\":\"51.54211267875101\"},\"space\":{\"space_title\":\"demo1\",\"space_id\":236,\"booking_approval\":true,\"key_feature\":\"sdfsd\",\"space_featured_image\":\"http:\\/\\/officeshare-