(196, 540, 'Ben Ruston', 388, 60, 65, 0, 0, '20', 1, 'enquiry_pending', '2021-12-22 13:27:19', '2021-12-22 13:27:20', '2021-12-22 00:00:00', '2021-12-24', '{\"property\":{\"property_title\":\"Da Vinci House\",\"property_id\":60,\"short_description\":\"A unique bright, contemporary and open plan space made to encourage a friendly collaborative environment.\\r\\nThis subterranean office space in Farringdon was designed and fitted out by E&A Securities, a business known for developing the highest quality spaces in unique locations.  \\r\\n\\r\\nFitted with a coffee bar, long hot-desking areas, break-out spaces and high-tech dedicated meeting rooms this venue is a fabulous setting for keynote meetings and city desk days. \\r\\n\\r\\nIdeally situated for both sides of town Da Vinci House is all of 300m from Farringdon Station and the amenities that have popped up around it.\",\"property_type\":\"Flexi desk\",\"description\":null,\"property_total_desk\":147,\"property_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/6156c7380a283EA_Iceni Timelapse-low.gif\",\"property_approved_status\":\"publish\",\"avg_rating\":5,\"disability_access\":true,\"describe_your_space\":\"\",\"how_to_find_us\":\"At Iceni Projects we believe that everything we do is ultimately about people \\u2013 and as a consultancy operating within the built environment, for people read place. A place to live, to work, to play. To grow up; to grow old. A sense of place. Everything in its place. A time and a place.\\r\\n\\r\\nWe are fortunate at Iceni to be able to call upon colleagues with a myriad of qualifications, specialisms and backgrounds, from archaeology to transport, operating across the country from four world class cities. However, what links us all is the belief that we can create better places by working collectively and collaboratively. So whether you choose to work with one individual or many, a planner or sustainability consultant, we put a commitment to place at the heart of what we do.\\r\\n\\r\\nWe firmly believe in the principles of sustainable development. We practice what we preach. We are committed to reducing our environmental impact and enhancing our contribution to society through a series of relevant targets that are regularly reviewed, monitored and updated. You can read more about our Environmental and Sustainability Policy here\",\"insurance\":\"Yep\",\"covid_19_secure\":\"Nope\",\"londload_name\":\"Liz Scott\",\"user_name\":\"Ben Ruston\",\"postcode\":\"EC1N 8FH\",\"address\":\"44 Saffron Hill, London, EC1N 8FH, UK\",\"city\":null,\"state\":\"England\",\"country\":\"United Kingdom\",\"longitude\":\"-0.1067835\",\"latitude\":\"51.52085270000001\"},\"space\":{\"space_title\":\"Open Workspace\",\"space_id\":65,\"booking_approval\":true,\"key_feature\":\"Find your own space and enjoy the facilities available at Da Vinci House.\\r\\nOur clean desk policy means you will have no problem finding a space to site.\\r\\nWe are set up to help Shares get going in 2 mins. We might even offer you refreshments and some light conversation if you are amenable.\",\"space_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/615c3cf2af3a4Screenshot 2021-09-30 at 13.10.22.png\",\"price\":\"20\",\"space_type\":\"Flexi desk\",\"sapce_total_desk\":\"10\",\"space_approved_status\":\"publish\",\"min_term\":\"1\",\"max_term\":\"100\",\"things_not_included\":\"Parking\"},\"booking_details\":{\"start_date\":\"2021-12-22\",\"booked_desk\":1,\"desk_price\":\"20\",\"total_price\":60,\"booking_dated\":\"[\\\"2021-12-22\\\",\\\"2021-12-23\\\",\\\"2021-12-24\\\"]\"}}', ''),
