 at the heart of what we do.\\r\\n\\r\\nWe firmly believe in the principles of sustainable development. We practice what we preach. We are committed to reducing our environmental impact and enhancing our contribution to society through a series of relevant targets that are regularly reviewed, monitored and updated. You can read more about our Environmental and Sustainability Policy here\",\"insurance\":\"Yep\",\"covid_19_secure\":\"Nope\",\"londload_name\":\"Liz Scott\",\"user_name\":\"Pradeep Malviya\",\"postcode\":\"EC1N 8FH\",\"address\":\"44 Saffron Hill, London, EC1N 8FH, UK\",\"city\":null,\"state\":\"England\",\"country\":\"United Kingdom\",\"longitude\":\"-0.1067835\",\"latitude\":\"51.52085270000001\"},\"space\":{\"space_title\":\"Open Workspace\",\"space_id\":65,\"booking_approval\":true,\"key_feature\":\"Find your own space and enjoy the facilities available at Da Vinci House.\\r\\nOur clean desk policy means you will have no problem finding a space to site.\\r\\nWe are set up to help Shares get going in 2 mins. We might even offer you refreshments and some light conversation if you are amenable.\",\"space_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/615c3cf2af3a4Screenshot 2021-09-30 at 13.10.22.png\",\"price\":\"20\",\"space_type\":\"Flexi desk\",\"sapce_total_desk\":\"10\",\"space_approved_status\":\"publish\",\"min_term\":\"1\",\"max_term\":\"100\",\"things_not_included\":\"Parking\"},\"booking_details\":{\"start_date\":\"2021-12-23\",\"booked_desk\":1,\"desk_price\":\"20\",\"total_price\":40,\"booking_dated\":\"[\\\"2021-12-23\\\",\\\"2021-12-30\\\"]\"}}', ''),
