(350, 380, 'Brayden OFCShare', 388, 60, 398, 1, 0, '14', 3, 'pending', '2022-01-27 06:31:30', '2022-01-27 06:31:30', '2022-01-28 00:00:00', '2022-01-29', '{\"property\":{\"property_title\":\"Da Vinci House\",\"property_id\":\"60\",\"short_description\":\"A unique bright, contemporary and open plan space made to encourage a friendly collaborative environment.\\r\\n\\r\\nThis subterranean office space in Farringdon was designed and fitted out by E&A Securities, a business known for developing the highest quality spaces in unique locations.  \\r\\n\\r\\nFitted with a coffee bar, long hot-desking areas, break-out spaces and high-tech dedicated meeting rooms this venue is a fabulous setting for keynote meetings and city desk days. \\r\\n\\r\\nIdeally situated for both sides of town Da Vinci House is all of 300m from Farringdon Station and the amenities that have popped up around it.\",\"property_type\":\"Exclusive Occupancy\",\"description\":null,\"property_total_desk\":147,\"property_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/6156c7380a283EA_Iceni Timelapse-low.gif\",\"property_approved_status\":\"publish\",\"avg_rating\":5,\"disability_access\":true,\"describe_your_space\":\"\",\"how_to_find_us\":\"At Iceni Projects we believe that everything we do is ultimately about people \\u2013 and as a consultancy operating within the built environment, for people read place. A place to live, to work, to play. To grow up; to grow old. A sense of place. Everything in its place. A time and a place.\\r\\n\\r\\nWe are fortunate at Iceni to be able to call upon colleagues with a myriad of qualifications, specialisms and backgrounds, from archaeology to transport, operating across the country from four world class cities. However, what links us all is the belief that we can create better places by working collectively and collaboratively. So whether you choose to work with one individual or many, a planner or sustainability consultant, we put a commitment to place at the heart of what we do.\\r\\n\\r\\nWe firmly believe in the principles of sustainable development. We practice what we preach. We are committed to reducing our environmental impact and enhancing our contribution to society through a series of relevant targets that are regularly reviewed, monitored and updated. You can read more about our Environmental and Sustainability Policy here\",\"insurance\":\"Yep\",\"covid_19_secure\":\"Nope\",\"londload_name\":\"Liz Scott\",\"user_name\":\"Brayden OFCShare\",\"postcode\":\"EC1N 8FH\",\"address\":\"44 Saffron Hill, London, EC1N 8FH, UK\",\"city\":null,\"state\":\"England\",\"country\":\"United Kingdom\",\"longitude\":\"-0.1067835\",\"latitude\":\"51.52085270000001\"},\"space\":{\"space_title\":\"Full Space (Whole Office)\",\"space_id\":398,\"booking_approval\":true,\"key_feature\":\"Enjoy Da Vinci House all by yourselves. Our beautiful space can be taken exclusively on set days by arrangement. If you like it you can even book the space exclusively on set days each week, month and more. We have a fully adaptable space with WFH capability \\u2013 so why not open the conversation about having one of London\\u2019s newest and most funky places in 2022. Enquire through the booking process or open a chat with the Host today.\",\"space_featured_image\":\"http:\\/\\/officeshare-cms.ewtlive.in\\/media\\/thumbnail\\/61c076ab21ea4Back to Cars.jpg\",\"price\":\"14\",\"space_type\":\"Exclusive Occupancy\",\"sapce_total_desk\":\"100\",\"space_approved_status\":\"publish\",\"min_term\":\"1\",\"max_term\":\"2000\",\"things_not_included\":\"Lorem ipsum dolor sit amet,\"},\"booking_details\":{\"start_date\":\"2022-01-28\",\"booked_desk\":\"1\",\"desk_price\":\"34\",\"total_price\":68,\"booking_dated\":\"[\\\"2022-01-28\\\",\\\"2022-01-29\\\"]\"}}', NULL),
