INSERT INTO `dbs_home_settings` (`id`, `name`, `slug`, `contents`, `created_at`, `updated_at`) VALUES
(1, 'header content', NULL, '<p><span style=\"color: #ffffff; font-family: Poppins, sans-serif; font-size: 60px; background-color: #ffffff;\">A passion for</span><br style=\"box-sizing: border-box; color: #ffffff; font-family: Poppins, sans-serif; font-size: 60px; background-color: #ffffff;\" /><span style=\"color: #ffffff; font-family: Poppins, sans-serif; font-size: 60px; background-color: #ffffff;\">connecting</span><br style=\"box-sizing: border-box; color: #ffffff; font-family: Poppins, sans-serif; font-size: 60px; background-color: #ffffff;\" /><span style=\"color: #ffffff; font-family: Poppins, sans-serif; font-size: 60px; background-color: #ffffff;\">people &amp; places</span></p>', '2021-07-16 08:53:00', '2021-07-16 10:12:19'),
(2, 'Safe working', NULL, '<h4 style=\"box-sizing: border-box; margin: 0px 0px 10px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">\r\nBenefits for all<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span>\r\n</h4>\r\n<h5 style=\"margin-bottom: 20px;margin-bottom: 20px;font-size: 1.5rem;\">Sharing your space as an OS Host.</h5>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: 0.9rem; background-color: #ffffff;\">Find out how easy it is to sign-up and start sharing your space. Helping other businesses join the flexible working world while generating income makes everyone happy.</span> <a herf=\"#\" style=\"color:#f05050; font-size: 0.9rem;\">Read our FAQs here</a></span></p>', '2021-07-16 08:54:35', '2021-07-16 08:54:35'),
(4, 'Tab Section Image', NULL, '<p><img role=\"presentation\" src=\"../../media/circle-with-image.png\" alt=\"\" width=\"614\" height=\"588\" /></p>', '2021-07-16 09:02:12', '2021-07-16 09:02:12'),
(5, 'Flexible Space', NULL, '<h3 class=\"tab-heading\" style=\"box-sizing: border-box; margin: 0px 0px 20px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">Flexing your options<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span></h3>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: 14.4px; background-color: #ffffff;\">The way we work has changed but the office is a little behind the curve. You might not want to be in an office in the same place every day. Equally someone with an office feels the same way. OS Hosts want to share their office spaces without prohibitive set up costs and appreciate that there are others who have embraced flexible working. You can book a single desk on a single day or take exclusive occupancy of space/s on specific days with specific frequency, all through OS.</span></span></p>', '2021-07-16 09:03:04', '2021-07-16 09:03:04'),
(6, 'Verification', NULL, '<h3 class=\"tab-heading\" style=\"box-sizing: border-box; margin: 0px 0px 20px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">Know your neighbour<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span></h3>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: 14.4px; background-color: #ffffff;\">OS uses sophisticated clever data from trusted sources to make sure our community participants are all verified and you know who you are about to make friends with. Both host and guest are validated on subscription or at point of payment.</span></span></p>', '2021-07-16 09:04:01', '2021-07-16 09:04:01'),
(7, 'Low Cost', NULL, '<h3 class=\"tab-heading\" style=\"box-sizing: border-box; margin: 0px 0px 20px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">Control and competition<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span></h3>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: 14.4px; background-color: #ffffff;\">Office pricing has traditionally been a one-sided endeavour with rather a lot of mouths to feed driving things ever higher. OS doesn’t need a lawyer, an agent, a long term commitment to bring the price down and a deposit that will make your eyes water. You simply pay for what you need.</span></span></p>', '2021-07-16 09:04:45', '2021-07-16 09:04:45'),
(8, 'Safe working', NULL, '<h4 style=\"box-sizing: border-box; margin: 0px 0px 10px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">\r\nBenefits for all<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span>\r\n</h4>\r\n<h5 style=\"margin-bottom: 20px;font-size: 1.5rem;\">Sharing your space as an OS Host.</h5>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: 19.2px; background-color: #ffffff;\">Find out how easy it is to sign-up and start sharing your space. Helping other businesses join the flexible working world while generating income makes everyone happy.</span> <a herf=\"#\" style=\"color:#f05050;\">Read our FAQs here</a></span></p>', '2021-07-16 08:54:35', '2021-07-16 08:54:35'),
(9, 'Safe working', NULL, '<h4 style=\"box-sizing: border-box; margin: 0px 0px 10px; font-weight: 500; line-height: 1.2; font-size: 36px; color: #212529; font-family: Poppins, sans-serif; background-color: #ffffff;\">\r\nBenefits for all<span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\">.</span>\r\n</h4>\r\n<h5 style=\"margin-bottom: 20px;margin-bottom: 20px;font-size: 1.5rem;\">Sharing your space as an OS Host.</h5>\r\n<p><span class=\"text-primary\" style=\"box-sizing: border-box; color: #f56565 !important;\"><span style=\"color: #212529; font-family: Poppins, sans-serif; font-size: .9rem; background-color: #ffffff;\">Find out how easy it is to sign-up and start sharing your space. Helping other businesses join the flexible working world while generating income makes everyone happy.</span> <a herf=\"#\" style=\"color:#f05050;\">Read our FAQs here</a></span></p>', '2021-07-16 08:54:35', '2021-07-16 08:54:35');
