(7, 'distributor', 1, '<p>Dear&nbsp;<strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{distributor_name},</span></strong></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Your&nbsp;</span><span style=\"color: #000000;\"><span style=\"background-color: #ffffff; font-family: Roboto, sans-serif; font-size: 14px;\">{distributor_company} is not right feit for our&nbsp;</span><span style=\"background-color: #ffffff; font-family: Roboto, sans-serif; font-size: 14px;\">{business_name} because your company type is&nbsp;</span></span><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{distributor_company_type}</span></p>\r\n\r\n<p><strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Thanks</span></strong></p>\r\n\r\n<p style=\"line-height: 1;\"><strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Team Ebolly</span></strong></p>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Distributors', '2020-12-19 08:21:09', '2021-08-23 08:44:09', 'Office Share', 'distributor'),
(11, 'packed', 1, '<p><span style=\"color: #000000; font-size: 18pt;\"><span style=\"font-family: Roboto, sans-serif; background-color: #ffffff;\">&nbsp;</span><span class=\"text-info\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; background-color: #ffffff;\">{logo}</span></span></p>\r\n\r\n<p><strong>Hello&nbsp;<span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{user_name},</span></strong></p>\r\n\r\n<p><strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">We </span><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Will be</span><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\"> dispatching </span><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">your order soon!</span></strong></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Thanku for your order from&nbsp;</span><strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{site_url}</span></strong></p>\r\n\r\n<p><span style=\"background-color: #ffffff; font-family: Roboto, sans-serif; font-size: 14px;\">your order number <strong>{order_number}&nbsp;</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"background-color: #ffffff; font-family: Roboto, sans-serif; font-size: 14pt;\">Order Packed</span></p>\r\n\r\n<p>Ready for Dispatch</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Message on order placed', '2021-01-22 09:41:20', '2021-08-23 08:46:26', 'Office Share', 'order'),
(12, 'placed', 1, '<div class=\"card-body\" id=\"add_space\">\r\n<section style=\"background-color: #fff;\">\r\n<div class=\"mail_image\"><img alt=\"\" src=\"http://officeshare-cms.ewtlive.in/images/mail_img_1629200730.png\" /></div>\r\n\r\n<div class=\"mail-heading\" style=\"margin-top: 30px; margin-left: 30px; font-family:Poppins;\">\r\n<h1 style=\"font-size: 25px;font-weight: 400;font-family:Poppins;\">Hello <span class=\"mail_head\" style=\"color: #fc6565; font-size:25px;font-weight: 400; font-family:Poppins;\">{name}</span></h1>\r\n</div>\r\n\r\n<div class=\"mail_text\" style=\"margin-top: 15px; margin-left: 30px\">\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 33px;font-weight: 400;font-family:Poppins;\">Thank you for making a Booking Space.</p>\r\n\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 33px;font-weight: 400;font-family:Poppins;\">We are expecting you on {date}.&nbsp;</p>\r\n\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 20px;font-weight: 400;font-family:Poppins;\">We look forward to your visit and hope we will be enjoy and<br />\r\nshare your experience at {space_name} as much as we will be enjoying you.&nbsp;</p>\r\n\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 33px;font-weight: 400;font-family:Poppins;\">See you very soon on {date},&nbsp;</p>\r\n</div>\r\n</section>\r\n</div>\r\n<style type=\"text/css\">.mail_image img{\r\nheight:100%;\r\nwidth:100%;\r\n}\r\n</style>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Booking Placed', '2021-01-22 10:15:24', '2021-11-09 12:29:18', 'Office Share', 'order'),
(14, 'cancelled', 1, '<p><span style=\"font-size: 10pt;\">Hello<span style=\"color: #000000;\">&nbsp;<span class=\"text-info\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; background-color: #ffffff;\">{user_name}</span><span style=\"font-family: Roboto, sans-serif; background-color: #ffffff;\">,</span></span></span></p>\r\n\r\n<p style=\"line-height: 1;\"><span style=\"color: #000000;\"><span style=\"font-family: Roboto, sans-serif; font-size: 14px; background-color: #ffffff;\">Your order </span></span><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{order_number}&nbsp; has been<strong> cancelled</strong> as per your request.</span></p>\r\n\r\n<p style=\"line-height: 1;\"><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Thank you for letting us know the reason of cancellation.we value your association with Twistshake and will strive to improve our services.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"background-color: #ffffff; font-family: Roboto, sans-serif; font-size: 14pt; color: #e03e2d;\">Order cancelled</span></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">As per Your Request&nbsp;</span></p>\r\n\r\n<p>Thanku for visit&nbsp;<strong><span style=\"background-color: #ecf0f1; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{site_url}</span></strong></p>\r\n\r\n<div style=\"color: #303030; font-family: Arial, Helvetica, sans-serif; font-size: 12px; padding: 12px;\">&nbsp;</div>\r\n\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #212121;\">\r\n<div style=\"padding: 0px 12px 5px;\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Booking Cancelled', '2021-01-22 11:07:14', '2021-08-24 19:22:01', 'Office Share', 'order'),
(16, 'out_for_reach', 1, '<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\">Out for Reach</span></p>\r\n\r\n<p>Dear&nbsp;<span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{user_name},</span></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">The Order&nbsp;</span><span style=\"font-family: Roboto, sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;</span><span class=\"text-info\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; background-color: #ffffff; color: #000000;\"><strong>{order_number}</strong>&nbsp;is now out for reach.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span class=\"text-info\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; background-color: #ffffff; color: #000000;\">Thanku for&nbsp;</span><span style=\"background-color: rgba(255, 255, 255, 0.05); font-family: Roboto, sans-serif; font-size: 14px;\">visit:&nbsp;&nbsp;</span><strong><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{site_url}</span></strong></p>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Order Out for reach', '2021-01-22 12:21:24', '2021-08-23 08:46:01', 'Office Share', 'order'),
(18, 'refunded', 1, '<p>Hello&nbsp;<span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">{user_name}</span></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Your order {order_number}&nbsp;<strong>Return&nbsp;</strong>request approved sucessfully,</span></p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Your pay amount refund in 7 days.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"background-color: #ffffff; color: #000000; font-family: Roboto, sans-serif; font-size: 14px;\">Thanku for visit&nbsp;</span><span style=\"font-family: Roboto, sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;</span><strong><span class=\"text-info\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; background-color: #ffffff;\">{site_url}</span></strong></p>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Order Refunded', '2021-01-22 12:55:44', '2021-08-23 08:50:25', 'Office Share', 'order'),
(20, 'cart_abandon', 1, '<table border=\"0\" style=\"border-collapse: collapse; width: 100.3%; height: 63px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 100%;\"><span style=\"font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: bold; background-color: #ffffff;\">&nbsp;</span><span class=\"text-dark\" style=\"box-sizing: border-box; -webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: bold; background-color: #ffffff; color: #343a40 !important;\">{business_logo}</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Dear&nbsp;<span style=\"background-color: #ffffff; color: #343a40; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: bold;\">{user_name}</span></p>\r\n\r\n<p><span style=\"font-family: \'Open Sans\', Arial, sans-serif; font-size: 14px; text-align: justify; background-color: #ffffff;\">Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book</span></p>\r\n\r\n<table border=\"1\" style=\"border-collapse: collapse; width: 100%; height: 42px;\">\r\n	<tbody>\r\n		<tr style=\"height: 21px;\">\r\n			<td style=\"width: 23.5983%; height: 21px;\"><strong>Product Name</strong></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><strong>Price</strong></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><strong>Discount</strong></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><strong>Total Price</strong></td>\r\n		</tr>\r\n		<tr style=\"height: 21px;\">\r\n			<td style=\"width: 23.5983%; height: 21px;\"><span style=\"color: #343a40; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">{product_name}</span></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><span style=\"color: #343a40; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">{price}</span></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><span style=\"color: #343a40; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">{discount}</span></td>\r\n			<td style=\"width: 23.5983%; height: 21px;\"><span style=\"font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;</span><span class=\"text-dark\" style=\"box-sizing: border-box; -webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff; color: #343a40 !important;\">{total_price}</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"line-height: 1.1;\"><strong>Thank You</strong></p>\r\n\r\n<p style=\"line-height: 1.1;\"><strong>Ebolly</strong></p>\r\n\r\n<p style=\"text-align: center;\">Vist our site:&nbsp;<span style=\"background-color: #ffffff; color: #343a40; font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14px;\">{site_url}</span></p>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Cart Abandon', '2021-05-08 12:54:03', '2021-08-23 08:41:05', 'Office Share', 'cart_abandon'),
(23, 'signup', 1, '<div class=\"card-body\" id=\"add_space\">\r\n<section style=\"background-color: #fff;\">\r\n<div class=\"mail_image\"><img alt=\"\" src=\"http://officeshare-cms.ewtlive.in/images/mail_img_1629200730.png\" style=\"height: auto;width: 100%;\" /></div>\r\n\r\n<div class=\"mail-heading\" style=\"margin-top: 30px; margin-left: 30px; font-family:Helvetica;\">\r\n<h1 style=\"font-size: 25px;font-weight: 400;font-family:Helvetica;\">Thank you for joining&nbsp;<span class=\"mail_head\" style=\"color: #fc6565; font-size:25px;font-weight: 400; font-family:Helvetica;\">OfficeShare</span>!</h1>\r\n</div>\r\n\r\n<div class=\"mail_text\" style=\"margin-top: 15px; margin-left: 30px\">\r\n<h3 style=\"color: #fc6565; font-size: 20px;line-height: 40px;margin: 20px 0 10px;font-weight: 500; font-family:Helvetica;\">Hey {first_name},</h3>\r\n\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 33px;font-weight: 400;font-family:Helvetica;\">Welcome to the OfficeShare community. Simply click the button below to verify your email and start sharing today.</p>\r\n</div>\r\n<style type=\"text/css\">a:hover {text-decoration: none;} a{\r\ntext-decoration: none;\r\n    cursor: pointer;}\r\n.mail_image img{\r\nheight:100%;\r\nwidth:100%;\r\n}\r\n</style>\r\n<div class=\"vertical-center\" style=\"text-align: center;padding:20px;\"><a href=\"{token}\" style=\"margin-top:3vw;margin-bottom: 4vw;background-color: #fe5f5f;color: #fff;padding: 5px 45px;border: 0px;font-size: 16px;font-family: Helvetica;border-radius: 58px;font-weight: 600;\">Verify your mail</a></div>\r\n</section>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Email Verification', '2021-08-16 09:22:25', '2021-12-22 07:01:37', 'Office Share', 'sign up'),
(24, 'forgot_password', 1, '<div class=\"card-body\" id=\"add_space\">\r\n<section style=\"background-color: #fff;\">\r\n<div class=\"mail_image\"><img alt=\"\" src=\"http://officeshare-cms.ewtlive.in/images/mail_img_1629200730.png\" /></div>\r\n\r\n<div class=\"mail-heading\" style=\"margin-top: 30px; margin-left: 30px; font-family:Poppins;\">\r\n<h1 style=\"font-size: 25px;font-weight: 400;font-family:Poppins;\">Hello&nbsp;, <span class=\"mail_head\" style=\"color: #fc6565; font-size:25px;font-weight: 400; font-family:Poppins;\">{name}</span></h1>\r\n</div>\r\n\r\n<div class=\"mail_text\" style=\"margin-top: 15px; margin-left: 30px\">\r\n<h3 style=\"color: #fc6565; font-size: 20px;line-height: 40px;margin: 20px 0 10px;font-weight: 500; font-family:Poppins;\">There was a request to change your password!</h3>\r\n\r\n<p style=\"margin-top: 10px;font-size: 14px;line-height: 33px;font-weight: 400;font-family:Poppins;\">Your OTP to change your OfficeShare Password is {otp}. If you have not made this request please ignore.</p>\r\n</div>\r\n<style type=\"text/css\">a:hover {text-decoration: none;} a{\r\ntext-decoration: none;\r\n    cursor: pointer;}\r\n.mail_image img{\r\nheight:100%;\r\nwidth:100%;\r\n}\r\n</style>\r\n</section>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Forget Password', '2021-08-17 12:10:02', '2021-08-19 12:05:47', 'Office Share', 'distributor'),
