(183, 'rating', 1, '<div class=\"container\" style=\"margin-top: 30px; float: left; \">\r\n<header><img src=\"http://officeshare-cms.ewtlive.in/images/mail/ratting-mail.png\" style=\"width:100%\" /></header>\r\n\r\n<div class=\"body\" style=\"/padding: 0px 0px; padding-bottom: 20px;border: none !important; background: none;\">\r\n<div class=\"head\" style=\" margin: 0 auto; width: 73%;\">\r\n<div class=\"imgaes\" style=\"text-align:end;\">\r\n<h4 style=\"font-size: 12px;margin-top: 30px; \"><span style=\"font-weight: 700;\">Booking Ref:</span> {{ref_id}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px; \"><span style=\"font-weight: 700;\">Property:</span> {{property_name}}</h4>\r\n</div>\r\n\r\n<div class=\"text-wrap\" style=\"width: 86%;\">\r\n<div class=\"head-text\">\r\n<h5 style=\"font-size:20px;margin: 0;  color:#0d324d; font-weight:400;\">Hello <span style=\"color:#fc6565\">{{name}}</span>,</h5>\r\n\r\n<h6 style=\"font-size:10px;  font-weight:1000;margin:30px 0px;\">We&rsquo;d love to know how you got on.</h6>\r\n\r\n<p style=\" line-height: 25px;font-size:10px;     margin: 22px 0px;  font-weight: 400; \">Feedback is really important, it&rsquo;s the glue that sticks us together.</p>\r\n\r\n<p style=\" line-height: 25px;font-size:12px;     margin: 22px 0px;  font-weight: 400; \">A good rating can make your day and if feedback isn&rsquo;t so good it can help you do better.</p>\r\n\r\n<div>\r\n<h6 style=\" margin-top: 30px; color: #0d324d;font-size: 13px; font-weight: 500; margin: 0px;\">Rate the Location:</h6>\r\n\r\n<p style=\" line-height: 25px;font-size:8px;     margin: 5px 0px; font-weight: 400;font-style: italic; \">Click on the star rating you believe to be fair.</p>\r\n\r\n<div class=\"star\" style=\"display: flex;\">{{rating_to_host}}</div>\r\n</div>\r\n\r\n<div style=\"margin-top: 30px; margin-bottom: 50px;\">\r\n<h6 style=\" margin-top: 30px; color: #0d324d;font-size: 13px; font-weight: 500; margin: 0px;\">Rate the Host:</h6>\r\n\r\n<p style=\