(184, 'booking_journey_started', 1, '<div class=\"container\" style=\"margin-top: 30px; float: left;\">\r\n<header><img src=\"http://officeshare-cms.ewtlive.in/images/mail/journey-started.png\" style=\"width:100%\" /></header>\r\n\r\n<div class=\"body\" style=\"border-bottom: none;border-top: none;float: left;padding: 0px 0px;margin-top: 60px;padding-bottom: 20px;border: none !important; background: none;\">\r\n<div style=\"margin: 0 auto;width: 70%;/* margin-top: 60px; */\">\r\n<div class=\"imgaes\" style=\"display: flex;align-items: flex-start;margin: 0% 0px;justify-content: flex-end;float: right;margin: -7% 0px;\"><img src=\"http://officeshare-cms.ewtlive.in/images/mailtemp-download.png\" style=\"margin: 8px; cursor:pointer;\" /></div>\r\n\r\n<div class=\"text-wrap\" style=\"    width: 86%;\">\r\n<div class=\"head-text\" style=\"border-bottom:1px solid #b3bcc6;\">\r\n<h5 style=\"font-size:20px;margin: 0; color:#0d324d; font-weight:400;\">Hello <span style=\"color:#fc6565\">{{name}}</span>,</h5>\r\n\r\n<h6 style=\"font-size:13px; font-weight:700;margin:30px 0px;\"><span style=\"color:#FC6565;\">SUCCESS! </span>You are on your journey to sharing a space with the Office share community.</h6>\r\n\r\n<p style=\" line-height: 25px; font-size:12px; margin: 22px 0px; font-weight: 400; \">We understand that you want to get going as fast as possible, but we need you to provide us a few more details about you and your business (if indeed you are a business) so as to make sure you are fully validated and able to receive guests and of course income. Your guests will also be required to do this. Validation is simple but you will need a few things</p>\r\n<button class=\"mail-btn\" style=\"font-weight: 600;margin-top: 15px;background-color: #FC6565;border: 0px;color: #fff;  width: auto; padding: 7px 30px;margin-bottom: 30px;font-size: 12px;border-radius: 20px;\">View things you need to get started</button></div>\r\n\r\n<div class=\"booking-info\" style=\"border-bottom:1px solid #b3bcc6;  margin-top: 35px;\">\r\n<h6 style=\" margin-top: 30px; color: #0d324d;font-size: 15px;font-weight: 500; margin: 0px;\">Receipt:<span style=\"font-size: 11px; color: #000;\"> (This payment will show as <span style=\"font-weight:500;\">OfficeShare</span> Ltd on your bank statement)</span></h6>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;\"><span style=\"font-weight: 600;\">Package Ordered:</span>&nbsp;{{package}} (View benefits)</h4>\r\n\r\n<h4 style=\"font-size: 12px;\"><span style=\"font-weight: 600;\">Start Date: </span> {{start_date}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;\"><span style=\"font-weight: 600;\">End date: </span> {{end_date}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;\"><span style=\"font-weight: 600;\">Terms: </span> {{terms}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top:40px;     margin-bottom: 4px;\"><span style=\"font-weight: 600;\">Price: </span> &pound;{{price}}</h4>\r\n\r\n<div class=\"btns\" style=\"display:flex;margin-bottom: 20px;margin-top: 10px;\"><button class=\"mail-btn\" style=\"font-weight: 600;margin-top: 15px;background-color: #FC6565;border: 0px;color: #fff;height: auto;width: 30%;padding: 10px;font-size: 12px;border-radius: 20px;margin-right:10px;\">{{invoice_link}}</button><button class=\"mail-btn\" style=\"margin-top: 15px;font-weight: 600;background-color: #FC6565;border: 0px;color: #fff;height: auto;padding: 10px;width:35%;font-size: 12px;border-radius: 20px;\">{{terms_condition}}</button></div>\r\n</div>\r\n\r\n<div class=\"about-office\">\r\n<h4 style=\"font-size: 12px;margin-top: 30px; margin-botton: 20px;font-weight: 600;\">Auto Renewal:</h4>\r\n\r\n<p style=\"font-size: 12px; font-weight: 400;\">After three months we will email you to let you know that your package will automatically be upgraded to Premium unless you want to cancel &ndash; which you can do in a single click.</p>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px; margin-botton: 20px;font-weight: 600;\">Our Role:</h4>\r\n\r\n<p style=\"font-size: 12px;font-weight: 400;\">Office share is a marketplace. We are a technology company with a sprinkling of property expertise and as such our role is as facilitator. Almost everything we do is standardised and process driven. Once on board you will be able to list locations and spaces quickly and seamlessly, showcasing them to our global community.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"discclaimer\" style=\"padding:30px; background-color:#e7eef3; border-radius: 20px; float:left;\">\r\n<div class=\"parts\" style=\"display:flex;\">\r\n<p style=\"    font-size: 11px; font-style: italic;  color: #000;\">Disclaimer: This email hs been sent to [xxxxxx] by OfficShare Ltd. Lorem ipsum dolor sit amet, nam et recusabo qualisque definitiones. Vidisse veritus oportere nam no. In etiam doming equidem vim. Amet iriure bonorum duo ea, ea animal civibus electram has. Vide augue quidam an mel, vix ad vidit instructior intellegebat. Natum dictas verear at sed. Ignota fabulas temporibus ne eam, te velit delicata assueverit mea, est partem imperdiet scribentur ei.</p>\r\n\r\n<p style=\"display: flex;align-items: flex-end; margin: 0px 0px 0px 50px; min-width:175px; text-decoration: underline; color: #FC6565; cursor:pointer;\">Unsubscribe</p>\r\n</div>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Booking Journey Started', '2021-08-23 12:52:36', '2022-01-06 07:09:03', 'Office Share', 'booking_journey_started'),
(185, 'booking_enquiry', 1, '<div class=\"container\" style=\"margin-top: 30px; float: left;\">\r\n<header><img src=\"http://officeshare-cms.ewtlive.in/images/mail/enquery-mail.png\" style=\"width:100%\" /></header>\r\n\r\n<div class=\"body\" style=\"padding: 0px 0px;margin: 0; padding-bottom: 20px;border: none !important; background: none;\">\r\n<div class=\"head\" style=\"margin: 0 auto;width: 73%;position: relative !important;\">\r\n<div class=\"imgaes\" style=\"text-align: end;\"><img src=\"http://officeshare-cms.ewtlive.in/images/mailtemp-download.png\" style=\"margin: 8px;cursor:pointer;height: auto;/* width:100%; */\" /></div>\r\n\r\n<div class=\"text-wrap\" head-text=\"\" style=\"width: 86%;&gt;\r\n      &lt;div class=\">\r\n<div style=\"border-radius: 50%; height:20px ; width:20px;\">\r\n<p style=\"color: #fff; color: #fff; background-color: #fc6565;border-radius: 50%; font-size: 12px;font-weight: 800; text-align: center; \">!</p>\r\n</div>\r\n\r\n<h5 style=\"font-size:20px;margin-top: 10px; font-family: \'Poppins\', sans-serif; color:#fc6565; font-weight:400;\">Action Required!</h5>\r\n\r\n<h6 style=\"font-size:10px; font-family: \'Poppins\', sans-serif; font-weight:900;margin:30px 0px;\">You have just had a booking enquiry from {{name}} at {{location}} in {{space_name}}</h6>\r\n</div>\r\n\r\n<div class=\"booking-info\" style=\"border-bottom:1px solid #b3bcc6;  margin-top: 35px;\">\r\n<h6 style=\" margin-top: 30px; color: #0d324d;font-size: 13px;font-family: \'Poppins\';font-weight: 500; margin: 0px;\">Booking Information</h6>\r\n\r\n<h4 style=\"font-size: 10px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Booking Ref:</span> {{ref_id}}</h4>\r\n\r\n<h4 style=\"font-size: 10px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Location: </span> {{location}}</h4>\r\n\r\n<h4 style=\"font-size: 10px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Space Name: </span> {{space_name}}</h4>\r\n\r\n<h4 style=\"font-size: 10px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">No. Desks:</span> {{number_of_desks}}</h4>\r\n\r\n<h4 style=\"font-size: 10px;margin-top: 30px;     margin-bottom: 4px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Dates:</span>&nbsp;{{booking_days}}</h4>\r\n\r\n<p style=\"font-size:10px;\">Opening Hours: <span style=\"font-weight: 800;\"> Day (09:00 - 18:30 GMT) Night (19:30 - 06:00 (+1) GMT )</span></p>\r\n\r\n<h4 style=\" margin-top: 30px;font-size: 12px; font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Starts: {{start_date}}</span>. &nbsp; &nbsp; <span style=\"font-weight: 600;\">Ends: </span>{{end_date}}</h4>\r\n\r\n<h4 style=\" margin-top: 30px;font-size: 12px; font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Value: </span> &pound;{{price}}</h4>\r\n\r\n<div class=\"con-btn\" style=\"display: flex;\"><a class=\"mail-btn\" href=\"{{approve_link}}\" style=\"font-weight: 600;margin-top: 15px;background-color: #24ae77;border: 0px;line-height: 0px;color: #fff;height: 20px;width: 150px;text-decoration: none;font-size: 12px;border-radius: 20px;text-align:center;padding: 20px 20px;\">Approve</a><br />\r\n<a class=\"mail-btn\" href=\"{{decline_link}}\" style=\"margin-top: 15px;font-weight: 600;background-color: #FC6565;border: 0px;color: #fff;line-height: 0px;margin: 15px 15px;text-decoration: none;height: 20px;width: 150px;font-size: 12px;border-radius: 20px;text-align:center;padding: 20px 20px;\">Decline</a>\r\n\r\n<p style=\"font-size:12px;font-family: \'Poppins\';font-weight: 500;cursor: pointer;line-height: 30px;color:#ff6b6b;text-decoration: underline;margin-bottom: 30px;margin-top:18px;\"><a href=\"http://officeshare.eoxysitsolution.com/#/login\">Open Dashboard</a></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"about-office\">\r\n<h4 style=\" margin-top: 30px;font-size: 10px; font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">ISSUES? </span>Are you experiencing issues with this User. <a href=\"#report/{{report}}\" style=\"font-size:12px; color:#ff6b6b; text-decoration: underline; cursor:pointer;font-weight: 500; \">Report them now</a></h4>\r\n</div>\r\n</div>\r\n\r\n<div class=\"for-admin-only\">\r\n<h4 style=\" margin-top: 20px;font-size: 10px; font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">for Admin only:</span></h4>\r\n<span style=\"margin-top: 20px;font-size: 10px; font-family: \'Poppins\';font-weight: 500; \">Your User ID is:{{admin_id}}. Enquiry from User ID:{{user_id}}</span></div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"discclaimer\" style=\"padding: 30px;background-color:#e7eef3;border-radius: 20px;margin: 0px 60px;float: left;\">\r\n<div class=\"parts\" style=\"display:flex;\">\r\n<p style=\"font-size: .8rem;font-style: italic;font-family: \'Poppins\';color: #000;width: 87%;\">Disclaimer: This email hs been sent to [xxxxxx] by OfficShare Ltd. Lorem ipsum dolor sit amet, nam et recusabo qualisque definitiones. Vidisse veritus oportere nam no. In etiam doming equidem vim. Amet iriure bonorum duo ea, ea animal civibus electram has. Vide augue quidam an mel, vix ad vidit instructior intellegebat. Natum dictas verear at sed. Ignota fabulas temporibus ne eam, te velit delicata assueverit mea, est partem imperdiet scribentur ei.</p>\r\n\r\n<p style=\"display: flex;align-items: flex-end;margin: 0px 0px 0px 25px;text-decoration: underline;color: #FC6565;cursor:pointer;     width: 125px;\">Unsubscribe</p>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Booking Enquiry', '2021-08-23 12:53:33', '2022-01-12 08:58:45', 'Office Share', 'booking_enquiry'),
(186, 'booking_success', 1, '<div class=\"container\" style=\"margin-top: 30px; width: 980px; margin: auto;\">\r\n<header><img src=\"http://officeshare-cms.ewtlive.in/images/mail/booking-img.png\" style=\"width:100%\" /></header>\r\n\r\n<div class=\"body\" style=\"background: none; padding-top: 15px;/* margin-top: -10%; */padding: 0px 0px; padding-bottom: 20px;border: none !important;\">\r\n<div class=\"head\" style=\" margin: 0 auto; width: 73%; /* margin-top: 70px; */ \">\r\n<div class=\"imgaes\" style=\"border: none !important; border-bottom: 0px solid #edeff2; border-top: 1px solid #edeff2; /* display: flex; *//* float: right; *//* align-items: flex-start; *//* margin: -7% 0px; *//* justify-content: flex-end; */text-align: end; \"><img src=\"http://officeshare-cms.ewtlive.in/images/mailtemp-wallet.png\" style=\"margin: 8px;cursor:pointer;/* height: 100%; *//* width:100%; */\" /> <img src=\"http://officeshare-cms.ewtlive.in/images/mailtemp-gpay.png\" style=\"margin: 8px;cursor:pointer;/* height: 100%; *//* width:100%; */\" /> <img src=\"http://officeshare-cms.ewtlive.in/images/mailtemp-download.png\" style=\"margin: 8px;cursor:pointer;height: -24%;/* width: 3%; */\" /></div>\r\n\r\n<div class=\"text-wrap\" style=\"width: 85%;\">\r\n<div class=\"head-text\" style=\"border-bottom:1px solid #b3bcc6;\">\r\n<h5 style=\"font-size: 20px; margin: 0px; font-family: Poppins, sans-serif; font-weight: 400;\"><span style=\"color: rgb(13, 50, 77);\">Hello </span><font color=\"#fc6565\">{{name}}</font><font color=\"#0d324d\">,</font></h5>\r\n\r\n<h6 style=\"font-size:13px; font-family: \'Poppins\', sans-serif; font-weight:700;margin:30px 0px;\">Congratulations! your booking is successful and full details are available now below.</h6>\r\n\r\n<p style=\" line-height: 25px;font-size:12px;margin: 22px 0px;font-family: \'Poppins\', sans-serif; font-weight: 400; \">Before you travel to your destination we always advise you to call the Host, to introduce yourself and establish a rapport. You can ask them any further questions, maybe about getting there (they&rsquo;ll have the lowdown), or see if you can book a meeting room, assuming you need one. If you need special access, have sticky tech questions it pays to share them ahead of time. Don&#39;t forget the host is as keen to have you share their space as you are to use it.</p>\r\n\r\n<p style=\" line-height: 25px;font-size:12px; font-family: \'Poppins\', sans-serif; font-weight: 400;margin-bottom: 30px;\">If you enjoy the stay feel free to let us know afterward - we&rsquo;ll send you a message asking for feedback both on the booking process and the Locations within a few days. By rating and providing feedback you&rsquo;ll be helping other Sharers make an informed choice and reward the Hosts for delivering the best experience.</p>\r\n</div>\r\n\r\n<div class=\"booking-info\" style=\"border-bottom:1px solid #b3bcc6; display: flex; margin-top: 35px;\">\r\n<div class=\"section-1\" style=\"width:70%;\">\r\n<h6 style=\" margin-top: 30px; color: #0d324d;font-size: 15px;font-family: \'Poppins\';font-weight: 500; margin: 0px;\">Booking Information</h6>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Booking Ref:</span> {{ref_id}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Location: </span> {{location}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Space Name: </span> {{space_name}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">No. Desks:</span> {{number_of_desks}}</h4>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 30px;     margin-bottom: 4px;font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Dates:</span>&nbsp;{{booking_days}}</h4>\r\n\r\n<p style=\"font-size:11px; font-weight: 400;\">Opening Hours: <span style=\"font-weight: 800;\"> Day (09:00 - 18:30 GMT) Night (19:30 - 06:00 (+1) GMT )</span></p>\r\n\r\n<h4 style=\" margin-top: 30px;font-size: 12px; font-family: \'Poppins\';\"><span style=\"font-weight: 600;\">Starts: </span> {{start_date}}. &nbsp; &nbsp; <span style=\"font-weight: 600;\">Ends: </span>{{end_date}}</h4>\r\n<button class=\"mail-btn\" style=\"font-weight: 600;margin-top: 15px;background-color: #FC6565;border: 0px;color: #fff; height: 25px; width: 130px;font-size: 12px;border-radius: 20px; float:left;\">{{invoice}}</button><button class=\"mail-btn\" style=\"margin-top: 20px;font-weight: 600; background-color: #FC6565;border: 0px;color: #fff;  height: 25px; width: 130px;font-size: 12px;border-radius: 20px; float:left;margin-left: 20px;\">{{cancel_policy}}</button>\r\n\r\n<p style=\"font-size:11px;font-weight: 400;font-family: \'Poppins\';    float:left;  margin-bottom: 30px; margin-top:10px; width:100%;\">{{refund_msg}}</p>\r\n</div>\r\n\r\n<div class=\"section-2\" style=\"width:30%; \">\r\n<div class=\"first\" style=\" width: 100%; text-align: center;\"><img src=\"http://officeshare-cms.ewtlive.in/images/boking-image.png\" style=\"height:100%; width: 100%;     max-width: 260px;\" /></div>\r\n\r\n<div class=\"second\" style=\" width: 100%; margin-top: 30px;\">\r\n<div class=\"mapimg thumbnail\" style=\" position: relative; text-align: center; background-image: url(\'http://officeshare-cms.ewtlive.in/images/map-123.png\');height: 155px;float: left;width: 100%; background-size: contain; padding-top: 110px; max-width: 185px; background-repeat: no-repeat;padding-top: 110px;\"><a class=\"mail-btn direction\" href=\"{{get_directions}}\" style=\"background-color: #FC6565;border: 0px;color: #fff;/* height: 25px; *//* width: 100%; */padding: 7px 8%;font-size: 12px;font-weight: 600;border-radius: 20px;top: -40px;position: relative;\">Get Direction </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"about-office\">\r\n<h5 style=\"margin-top: 35px;font-size: 17px;font-family: \'Poppins\';font-weight: 600;color: #ee7b77;\">Property Hosted by {{host_name}}</h5>\r\n\r\n<div class=\"prop \" style=\"display:flex;\">{{profile_pic}}\r\n<p style=\"color: #0d324d; margin: 10px;font-weight: 600; font-family: \'Poppins\';\">{{rating}}<br />\r\n<span style=\"font-weight:500;\">({{rating_status}})</span></p>\r\n</div>\r\n\r\n<h6 style=\"font-size:13px; font-family: \'Poppins\', sans-serif; font-weight:900; margin: 30px 0px;\">A Message from your Host:</h6>\r\n\r\n<p style=\"line-height: 25px;font-size:12px; font-family: \'Poppins\', sans-serif; font-weight: 500;     margin: 30px 0px;\">Hello,</p>\r\n\r\n<p style=\"line-height: 25px;font-size:12px; font-family: \'Poppins\', sans-serif; font-weight: 500;     margin: 30px 0px;\">I&rsquo;m delighted that you have chosen to enjoy our Office. We operate a great business and encourage a sense of inclusive professionalism. Our people are approachable, hard-working and we know you&rsquo;ll get on well with them.</p>\r\n\r\n<p style=\"line-height: 20px;font-size:12px; font-family: \'Poppins\', sans-serif; font-weight: 500;     margin: 20px 0px;\">If you need anything at all you can email me at {{host_email}}</p>\r\n\r\n<div class=\"sub-str\" style=\"display:flex;\"><button class=\"mail-btn\" style=\"\r\n                           margin-top: 15px;\r\n                           background-color: #FC6565;\r\n                           border: 0px;\r\n                           color: #fff;\r\n                           height: auto;\r\n                           width: 250px;\r\n                           font-size: 12px;\r\n                           font-weight: 600;\r\n                           border-radius: 20px;\r\n                           \">{{chat_with_host_name}}</button>\r\n\r\n<h4 style=\"font-size: 12px;margin-top: 22px;font-family: \'Poppins\'; margin-left: 30px;\"><span style=\"font-weight: 600;\">Host Contact Number: </span> {{host_phone}}</h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"discclaimer\" style=\"padding:30px;margin:30px;background-color:#e7eef3; border-radius: 20px; float: left;\">\r\n<div class=\"parts\" style=\"display:flex;\">\r\n<p style=\"    font-size: 11px; font-style: italic; font-family: \'Poppins\'; color: #000;\">Disclaimer: This email hs been sent to [xxxxxx] by OfficShare Ltd. Lorem ipsum dolor sit amet, nam et recusabo qualisque definitiones. Vidisse veritus oportere nam no. In etiam doming equidem vim. Amet iriure bonorum duo ea, ea animal civibus electram has. Vide augue quidam an mel, vix ad vidit instructior intellegebat. Natum dictas verear at sed. Ignota fabulas temporibus ne eam, te velit delicata assueverit mea, est partem imperdiet scribentur ei.</p>\r\n\r\n<p style=\"display: flex;align-items: flex-end;margin: 0px 0px 0px 50px; text-decoration: underline;color: #FC6565; cursor:pointer; width: 250px;\">Unsubscribe</p>\r\n</div>\r\n</div>', 'ewttest2016@gmail.com', 'ewttest2016@gmail.com', 'Booking Successful', '2021-08-23 12:53:43', '2022-01-06 11:16:23', 'Office Share', 'booking_success');
