(81, NULL, '#office-3', 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.', '<p><span style=\"font-weight: bold; color: #5f6368; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Lorem ipsum</span><span style=\"color: #4d5156; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.&nbsp;</span></p>', NULL, 1000, NULL, 990, '60df21aa6c875office-img2.jpg', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-02 14:24:42', '2021-07-02 14:24:42'),
