(90, NULL, 'office-A', 'abc', '<p>&nbsp; &nbsp; &nbsp; abc</p>', 100, 100, NULL, 90, '60eead455efbcistockphoto-1182529932-612x612.jpg', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-14 09:24:21', '2021-07-14 09:24:21'),
(91, NULL, 'office-B', 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.', '<p><span style=\"font-weight: bold; color: #5f6368; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Lorem ipsum</span><span style=\"color: #4d5156; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.</span></p>', 50, 100, NULL, 90, '60eeaf50b9c7distockphoto-1182529932-612x612.jpg', NULL, 1, '3', 1, 'Dedicated', NULL, '2021-07-14 09:33:04', '2021-07-14 09:33:04'),
(92, NULL, 'Regus', 'We have office space and more to suit all budgets, in every city of the world. Our advisors are ready to help you find the right place for you.', '<p>Build your business in the prestigious &lsquo;Pink City&rsquo; of Jaipur, a thriving tourist and business destination. Located on the main Tonk Road and only 2km from Jaipur International Airport, you&rsquo;ll be ideally placed to welcome clients to this popular city.</p>', 10, 10000, NULL, 9000, '60eeb2c9c8f784130_5.webp', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-14 09:47:53', '2021-07-14 09:47:53'),
(93, NULL, 'Office-C', 'This beautiful workspace with intelligent design is one of the premium and exclusive business centres in Jaipur, Rajasthan.', '<p>This custom plug &amp; play centre by Skootr is located at Jaipur Centre, the high-end retail and highly efficient office complex is strategically located at the junction of Tonk Road and B2 Bypass, near the airport. It is also one of the first commercial green buildings in the state of Rajasthan. This Skootr centre offers a smartly configured floor plan designed to promote worker productivity in a collaborative environment.</p>', 20, 8700, NULL, 7500, '60eeb461d39ad1.png', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-14 09:54:41', '2021-07-14 09:54:41'),
(94, NULL, 'Apna Office - Co Working', 'Coworking is an arrangement in which several workers from different companies share an office space, allowing cost savings and convenience through the use of common infrastructure, such as equipment,  parcel acceptance services.', '<p>Coworking is an arrangement in which several workers from different companies share an office space, allowing cost savings and convenience through the use of common infrastructure, such as equipment, utilities, and receptionist and custodial services, and in some cases refreshments and parcel acceptance services.</p>', 30, 60000, NULL, 10, '60eeb66dcb205Berlin.jpg', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-14 10:03:25', '2021-07-14 10:03:25'),
(95, NULL, 'Mr Cowork', 'Our CoWorking Space provides amazing office space to all out of the box thinkers.There are communities of people all over the city who are gathering to share space and help each other. We are here to help you find your people.', '<p>Mr CoWork provides a premium CoWorking space suitable for both freelancers and entrepreneurs. It has become easier for you to grab a space among the happening hotspot for the startups. If you are looking for a CoWorking space in Jaipur, there is no better option that Mr CoWork for carrying out your work.<br /><br />The best thing about the service that we are providing is that everything is available at a very affordable price. You can utilize Mr Co-Work by paying an amount of Rs 3,999 in a month. Our co-working sp</p>', 15, 58000, NULL, 57986, '60eeb7e97729emr-cowork-jaipur-1.jpg', NULL, 1, '0', 1, 'Dedicated', NULL, '2021-07-14 10:09:45', '2021-07-14 10:09:45'),
(96, NULL, 'SUN PHARMA OFFICE', 'Sun Pharmaceutical Industries Ltd. (Sun Pharma) is the fourth largest specialty generic pharmaceutical company in the world with global revenues of over US$ 4.5 billion.', '<p><span id=\"page41R_mcid15\" class=\"markedContent\"><span dir=\"ltr\" style=\"left: 93.8989px; top: 720.587px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.997284);\">Sun Pharma is the world\'s fourth largest specialty generic pharmaceutical company and India\'s top pharmaceutical </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 740.122px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.993577);\">company. A vertically integrated business and a skilled team enables it to deliver high</span><span dir=\"ltr\" style=\"left: 714.573px; top: 740.122px; font-size: 15.8325px; font-family: sans-serif;\">-</span><span dir=\"ltr\" style=\"left: 720.711px; top: 740.122px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(1.00735);\">quality products, trusted </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 759.592px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.969433);\">by customers and patients in </span><span dir=\"ltr\" style=\"left: 313.402px; top: 759.592px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.976143);\">over 100 countries across the world, at affordable prices. Its global presence is </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 779.078px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.992693);\">supported by manufacturing facilities spread across 6 continents and approved by multiple regulatory agencies, </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 798.613px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(1.00096);\">coupled with a multi</span><span dir=\"ltr\" style=\"left: 237.763px; top: 798.613px; font-size: 15.8325px; font-family: sans-serif;\">-</span><span dir=\"ltr\" style=\"left: 243.902px; top: 798.613px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(1.00695);\">cultural workforce comprising over 50 nati</span><span dir=\"ltr\" style=\"left: 547.528px; top: 798.613px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.994539);\">onalities. Sun Pharma fosters excellence through </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 818.099px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.992811);\">innovation supported by strong R&amp;D capabilities across multiple R&amp;D centers, with investments of approximately </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 837.634px; font-size: 15.8325px; font-family: sans-serif;\">6</span><span dir=\"ltr\" style=\"left: 102.424px; top: 837.634px; font-size: 15.8325px; font-family: sans-serif;\">-</span><span dir=\"ltr\" style=\"left: 108.513px; top: 837.634px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.990044);\">7% of annual revenues in R&amp;D. For further information, please visit </span></span><span id=\"page41R_mcid16\" class=\"markedContent\"><span dir=\"ltr\" style=\"left: 625.587px; top: 837.634px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(1.01232);\">www.sunpharma.com</span></span><span id=\"page41R_mcid17\" class=\"markedContent\"><span dir=\"ltr\" style=\"left: 788.994px; top: 837.634px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.985118);\">&amp; follow us on </span><span dir=\"ltr\" style=\"left: 93.8989px; top: 858.322px; font-size: 15.8325px; font-family: sans-serif; transform: scaleX(0.986234);\">Twitter @SunPharma_Live</span></span></p>', 30, 50000, NULL, 49998, '60eeb95cf1367Speciality-Medications.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:15:56', '2021-07-14 10:15:56'),
(97, NULL, 'Central Pension Accounting Office', 'The Central (Civil) pensions are authorized through Central Pension Accounting Office (CPAO) functioning under the Controller General of Accounts.', '<p>CPAO has developed a mobile responsive facility for use of pensioners for availing of various services.CPAO has developed a mobile responsive facility for use of pensioners for availing of various services.<br /><br /></p>', 35, 580000, NULL, 579995, '60eebb51e600fimages.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:24:17', '2021-07-14 10:24:17'),
(98, NULL, 'Qbicle - Coworking Space', 'Coworking in Jaipur is crossing the new in town phase and we are aiding it.', '<p>Qbicle is a trusted provider for the <strong style=\"font-weight: bold;\">best co working space in Jaipur</strong> and we\'re glad that we have been part of so many start-ups and businesses as they embarked upon their new journey. Qbicle is reimagining the culture of shared office space in Jaipur and not only our offices are clean and safe but they provide unmatched flexibility. Our untainted track record has made us one of the most reputed providers of co working space Jaipur. Whether you\'re a startup or a well-established agency, we have the most flexible and affordable shared workplace plans for you that you\'ll have a hard time saying no to. If you\'re boggled with the question \"Where can I find the best coworking space near me\" then Qbicle is where you must go. Scale your business to new heights and lighten the burden on your pockets by being a part of the best co work space in Jaipur.</p>', 20, 5000, NULL, 2, '60eebd2e54bc4qbicle2.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:32:14', '2021-07-14 10:32:14'),
(99, NULL, 'Creware Coworks', 'Jaipur is known for its glory, pride, and rich culture, and now transforming to become a Startup-Hub in Rajasthan', '<p>Our vision to empower startups, entrepreneurs, freelancers, and corporates to be a part of redefining the glory by providing Startups a friendly Coworking Space in the Heart of Jaipur-Mansarovar. Creware Coworks is here to revolutionize your working experience.</p>', 40, 5000, NULL, 5, '60eebe615d423image-3.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:37:21', '2021-07-14 10:37:21'),
(100, NULL, 'Great Arc Bhavan-1, Survey Of India', 'Survey of India, The National Survey and Mapping Organization of the country under the Department of Science & Technology, is the OLDEST SCIENTIFIC DEPARTMENT OF THE GOVT. OF INDIA.', '<p>It was set up in 1767 and has evolved rich traditions over the years. In its assigned role as the nation\'s Principal Mapping Agency, Survey of India bears a special responsibility to ensure that the country\'s domain is explored and mapped suitably, provide base maps for expeditious and integrated development and ensure that all resources contribute with their full measure to the progress, prosperity and security of our country now and for generations to come.</p>', 18, 4500, NULL, 5, '60eec0358ebcbindex-2.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:45:09', '2021-07-14 10:45:09'),
(101, NULL, 'Hero Fincorp Ltd.', 'Finance Made Easy. Three simple words, that drive India\'s next generation ultra-lean credit champion.', '<p>Today, we\'re present at close to 2000 retail financing touch-points across Hero MotoCorp\'s network, and have partnered with over 2000 satisfied corporate clients. Going forward, we plan to continuously expand our offerings and geographic presence, whilst offering class leading financial services to all sections of our society.</p>', 25, 2500, NULL, 10, '60eec19b66d18index-3.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-14 10:51:07', '2021-07-14 10:51:07'),
(102, NULL, 'office-demo', 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs', '<p><span style=\"font-weight: bold; color: #5f6368; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Lorem ipsum</span><span style=\"color: #4d5156; font-family: arial, sans-serif; font-size: 14px; background-color: #ffffff;\">, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs</span></p>', 50, 100, NULL, NULL, '60efef7438842istockphoto-1182529932-612x612.jpg', NULL, NULL, '0', 1, 'Dedicated', NULL, '2021-07-15 08:19:00', '2021-07-15 08:19:00'),
