(2, 'privacy policy', 'privacy policy', '<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Privacy Notice</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"FR\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Introduction</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Welcome to the privacy notice of Office Share.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Office Share respects your privacy and is committed to protecting your personal data. </span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This privacy notice will inform you as to how we look after your personal data when you visit our website (regardless of where you visit it from) and tell you about your privacy rights and how the law protects you.</span></span></span></span></span></span><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This privacy notice is provided in a layered format so you can click through to the specific areas set out below. </span></span></span><br />\r\n<span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Please also use the Glossary to understand the meaning of some of the terms used in this privacy notice.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<ol>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">IMPORTANT INFORMATION AND WHO WE ARE</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">THE DATA WE COLLECT ABOUT YOU</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">HOW IS YOUR PERSONAL DATA COLLECTED</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span lang=\"DE\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">HOW WE USE YOUR PERSONAL DATA</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">DISCLOSURES OF YOUR PERSONAL DATA</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span lang=\"DE\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">INTERNATIONAL TRANSFERS</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">DATA SECURITY</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">DATA RETENTION</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">YOUR LEGAL RIGHTS</span></span></span></em></strong></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">GLOSSARY</span></span></span></em></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span></p>\r\n\r\n<ol>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Important information and who we are</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Purpose of this privacy notice</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This privacy notice aims to give you information on how Office Share collects and processes your personal data through your use of this website, including any data you may provide through this website when you join our mailing list or contact us by emailing via one of the &lsquo;Contact Us&rsquo; options.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This website is not intended for children and we do not knowingly collect data relating to children.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">It is important that you read this privacy notice together with any other privacy notice or fair processing notice we may provide on specific occasions when we are collecting or processing personal data about you so that you are fully aware of how and why we are using your data. This privacy notice supplements the other notices and is not intended to override them.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"DA\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Controller</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Office Share is the controller and responsible for your personal data (collectively referred to as &ldquo;Office Share&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo; or &ldquo;</span></span></span><span lang=\"FR\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">our</span></span></span><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">&rdquo; in this privacy notice).</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We have appointed a data privacy manager who is responsible for overseeing questions in relation to this privacy notice. If you have any questions about this privacy notice, including any requests to exercise <u>your legal rights</u>, please contact the data privacy manager using the details set out below.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Contact details</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Our full details are :Davinci House, 44 Saffron Hill, Farringdon, London</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Name or title of data privacy manager: C/o B Rushton</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Email address:ben@office-share.io</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Postal address: </span></span></span><span lang=\"IT\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Davinci House, 44 Saffron Hill, Farringdon, London</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Telephone number: &nbsp;07483102680</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You have the right to make a complaint at any time to the Information Commissioner&rsquo;s Office (ICO), the UK supervisory authority for data protection issues (www.ico.org.uk). We would, however, appreciate the chance to deal with your concerns before you approach the ICO so please contact us in the first instance.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Changes to the privacy notice and your duty to inform us of changes</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This version was last updated on 01 July 2020.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">It is important that the personal data we hold about you is accurate and current. Please keep us informed if your personal data changes during your relationship with us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Third-party links</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">This website may include links to third-party websites, plug-ins and applications. Clicking on those links or enabling those connections may allow third parties to collect or share data about you. We do not control these third-party websites and are not responsible for their privacy statements. When you leave our website, we encourage you to read the privacy notice of every website you visit.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span></p>\r\n\r\n<ol start=\"2\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">The data we collect about you</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Personal data, or personal information, means any information about an individual from which that person can be identified. It does not include data where the identity has been removed (anonymous data).</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We may collect, use, store and transfer different kinds of personal data about you which we have grouped together follows:</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"NL\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Identity Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes first name, last name, username or similar identifier, marital status, title, date of birth and gender.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"NL\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Contact Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes postal address, email address and telephone numbers.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"NL\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Financial Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes bank account details.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"NL\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Transaction Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes details about payments to and from you and other details of any services you have purchased from us.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Technical Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes internet protocol (IP) address, your login data, browser type and version, time zone setting and location, browser plug-in types and versions, operating system and platform and other technology on the devices you use to access this website.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"DE\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Profile Data </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">includes your interests, preferences, feedback and survey responses.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"DE\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Usage Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes information about how you use our website and services.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Marketing and Communications Data </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">includes your preferences in receiving marketing from us and our third parties and your communication preferences.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Employment Data</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> includes employment history, background checks, information from referees, whether a personal or professional referee, about your background, work experience, or work ethic.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We also collect, use and share <strong>Aggregated Data</strong> such as statistical or demographic data for any purpose. Aggregated Data may be derived from your personal data but is not considered personal data in law as this data does <strong>not</strong> directly or indirectly reveal your identity. For example, we may aggregate your Usage Data to calculate the percentage of users accessing a specific website feature. However, if we combine or connect Aggregated Data with your personal data so that it can directly or indirectly identify you, we treat the combined data as personal data which will be used in accordance with this privacy notice.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We do not collect any <strong>Special Categories of Personal Data</strong> about you (this includes details about your race or ethnicity, religious or philosophical beliefs, sex life, sexual orientation, political opinions, trade union membership, information about your health and genetic and biometric data). Nor do we collect any information about criminal convictions and offences.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">If you fail to provide personal data</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Where we need to collect personal data by law, or under the terms of a contract we have with you and you fail to provide that data when requested, we may not be able to perform the contract we have or are trying to enter into with you (for example, to provide you with goods or services). In this case, we may have to cancel a product or service you have with us but we will notify you if this is the case at the time.</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"3\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">How is your personal data collected?</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We use different methods to collect data from and about you including through:</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Direct interactions.</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> You may give us your Identity, Contact and Financial Data by filling in forms or by corresponding with us by post, phone, email or otherwise. This includes personal data you provide when you:</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">enquire about our services;</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">join our mailing list;</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">request marketing to be sent to you;</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">enter a competition, promotion or survey;</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">give us some feedback; or</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">instruct us on a project to undertake work on behalf of you or a third party.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Automated technologies or interactions.</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> As you interact with our website, we may automatically collect Technical Data about your equipment, browsing actions and patterns. We collect this personal data by using cookies, server logs and other similar technologies. Please see our cookie policy or further details.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Third parties or publicly available sources.</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> We may receive personal data about you from various third parties and public sources as set out below:</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Technical Data from the following parties: analytics providers such as Google</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Identity and Contact Data from publicly available sources such as Companies House;</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Identity and Contact Data from event ticketing operators and marketing platforms</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<ol start=\"4\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">How we use your personal data</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">When we receive personal data through our website, this will be stored in our database.&nbsp; We will also store personal data in other formats, for example, in our email system.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We will only use your personal data when the law allows us to. Most commonly, we will use your personal data in the following circumstances:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Where we need to perform the contract we are about to enter into or have entered into with you.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Where it is necessary for our legitimate interests (or those of a third party) and your interests and fundamental rights do not override those interests.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Where we need to comply with a legal or regulatory obligation.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Generally we do not rely on consent as a legal basis for processing your personal data other than in relation to sending third party direct marketing communications to you via email or text message. You have the right to withdraw consent to marketing at any time by contacting us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span><span st