yle=\"font-size: 10pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Contact</span></span></span></span></span></p>\r\n\r\n			<p class=\"TableStyle2\" style=\"border: none;\"><span style=\"font-size: 10pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Technical</span></span></span></span></span></p>\r\n\r\n			<p class=\"TableStyle2\" style=\"border: none;\"><span style=\"font-size: 10pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span lang=\"IT\" style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Usage</span></span></span></span></span></p>\r\n\r\n			<p class=\"TableStyle2\" style=\"border: none;\"><span style=\"font-size: 10pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Profile</span></span></span></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom: 1px solid black; width: 260px; padding: 16px 11px 16px 11px; height: 137px; border-top: none; border-right: 1px solid black; border-left: none;\">\r\n			<p class=\"TableStyle2\" style=\"border: none;\"><span style=\"font-size: 10pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Necessary for our legitimate interests (to develop our services and grow our business)</span></span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Marketing</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We strive to provide you with choices regarding certain personal data uses, particularly around marketing and advertising. We have established the following personal data control mechanisms:</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Promotional offers from us</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We may use your Identity, Contact, Technical, Usage and Profile Data to form a view on what we think you may want or need, or what may be of interest to you. This is how we decide which products, services and offers may be relevant for you (we call this marketing).</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You will receive marketing communications from us if you have requested information from us or purchased services from us and, in each case, you have not opted out of receiving that marketing.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Third-party marketing</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We will get your express opt-in consent before we share your personal data with any third party company for direct marketing purposes.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Opting out</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You can ask us or third parties (within our control) to stop sending you marketing messages at any time by following the opt-out links on any marketing message sent to you or by contacting us at any time.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Where you opt out of receiving these marketing messages, this will not apply to personal data provided to us as a result of other transactions.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\">&nbsp;</span></span></span><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Cookies</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You can set your browser to refuse all or some browser cookies, or to alert you when websites set or access cookies. If you disable or refuse cookies, please note that some parts of this website may become inaccessible or not function properly. For more information about the cookies we use, please see our Cookie Policy.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Change of purpose</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We will only use your personal data for the purposes for which we collected it, unless we reasonably consider that we need to use it for another reason and that reason is compatible with the original purpose. If you wish to get an explanation as to how the processing for the new purpose is compatible with the original purpose, please contact us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">If we need to use your personal data for an unrelated purpose, we will notify you and we will explain the legal basis which allows us to do so.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Please note that we may process your personal data without your knowledge or consent, in compliance with the above rules, where this is required or permitted by law.</span></span></span></span></span></span></p>\r\n\r\n<ol>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Disclosures of your personal data</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We may have to share your personal data with the parties set out below for the purposes set out in the table in paragraph 4 above.</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">External Third Parties as set out in the <em>Glossary</em>.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Specific third parties such as our IT technical and support consultants, our website design agency and where you are to attend any events which are jointly provided together with other consultancy firms which will be determined at the time of the applicable event.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Third parties to whom we may choose to sell, transfer, or merge parts of our business or our assets. Alternatively, we may seek to acquire other businesses or merge with them. If a change happens to our business, then the new owners may use your personal data in the same way as set out in this privacy notice.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We require all third parties to respect the security of your personal data and to treat it in accordance with the law. We do not allow our third-party service providers to use your personal data for their own purposes and only permit them to process your personal data for specified purposes and in accordance with our instructions.</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"2\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">International transfers</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We do not transfer your personal data outside the European Economic Area (</span></span></span><strong><span lang=\"FR\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">EEA</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">).</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"3\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Data security</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We have put in place appropriate security measures to prevent your personal data from being accidentally lost, used or accessed in an unauthorised way, altered or disclosed. In addition, we limit access to your personal data to those employees, agents, contractors and other third parties who have a business need to know. They will only process your personal data on our instructions and they are subject to a duty of confidentiality.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We have put in place procedures to deal with any suspected personal data breach and will notify you and any applicable regulator of a breach where we are legally required to do so.</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"4\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"IT\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Data retention</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">How long will you use my personal data for?</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We will only retain your personal data for as long as necessary to fulfil the purposes we collected it for, including for the purposes of satisfying any legal, accounting, or reporting requirements.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">To determine the appropriate retention period for personal data, we consider the amount, nature, and sensitivity of the personal data, the potential risk of harm from unauthorised use or disclosure of your personal data, the purposes for which we process your personal data and whether we can achieve those purposes through other means, and the applicable legal requirements.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Details of retention periods for different aspects of your personal data are available in our retention policy which you can request from us by contacting us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">In some circumstances you can ask us to delete your data: see <em>Request erasure</em> below for further information.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">In some circumstances we may anonymise your personal data (so that it can no longer be associated with you) for research or statistical purposes in which case we may use this information indefinitely without further notice to you.</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"5\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Your legal rights</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Under certain circumstances, you have rights under data protection laws in relation to your personal data. Please click on the links below to find out more about these rights:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request access to your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request correction of your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request erasure of your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Object to processing of your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request restriction of processing your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request transfer of your personal data</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Right to withdraw consent</span></span></span></em><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">If you wish to exercise any of the rights set out above, please contact us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">No fee usually required</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You will not have to pay a fee to access your personal data (or to exercise any of the other rights). However, we may charge a reasonable fee if your request is clearly unfounded, repetitive or excessive. Alternatively, we may refuse to comply with your request in these circumstances.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">What we may need from you</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We may need to request specific information from you to help us confirm your identity and ensure your right to access your personal data (or to exercise any of your other rights). This is a security measure to ensure that personal data is not disclosed to any person who has no right to receive it. We may also contact you to ask you for further information in relation to your request to speed up our response.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Time limit to respond</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">We try to respond to all legitimate requests within one month. Occasionally it may take us longer than a month if your request is particularly complex or you have made a number of requests. In this case, we will notify you and keep you updated.</span></span></span></span></span></span></p>\r\n\r\n<ol start=\"6\">\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Glossary</span></span></span></strong></span></span></span></li>\r\n</ol>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">LAWFUL BASIS</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Legitimate Interest</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> means the interest of our business in conducting and managing our business to enable us to give you the best service/product and the best and most secure experience. We make sure we consider and balance any potential impact on you (both positive and negative) and your rights before we process your personal data for our legitimate interests. We do not use your personal data for activities where our interests are overridden by the impact on you (unless we have your consent or are otherwise required or permitted to by law). You can obtain further information about how we assess our legitimate interests against any potential impact on you in respect of specific activities by contacting us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Performance of Contract</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> means processing your data where it is necessary for the performance of a contract to which you are a party or to take steps at your request before entering into such a contract.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Comply with a legal or regulatory obligation</span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\"> means processing your personal data where it is necessary for compliance with a legal or regulatory obligation that we are subject to.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span lang=\"DE\" style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">THIRD PARTIES</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">External Third Parties</span></span></span></strong></span></span></span></p>\r\n\r\n<ul>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Service providers acting as processors based in the European Economic Area who provide IT, system administration, marketing and advertising services.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Professional advisers acting as processors or joint controllers including lawyers, bankers, auditors and insurers based in the European Economic Area who provide consultancy, banking, legal, insurance and accounting services.</span></span></span></span></span></span></li>\r\n	<li class=\"Default\" style=\"border: none; margin-left: 8px;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">HM Revenue &amp; Customs, regulators and other authorities acting as processors or joint controllers based in the United Kingdom who require reporting of processing activities in certain circumstances.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">YOUR LEGAL RIGHTS</span></span></span></strong></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">You have the right to:</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request access </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">to your personal data (commonly known as a &ldquo;data subject access request&rdquo;). This enables you to receive a copy of the personal data we hold about you and to check that we are lawfully processing it.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request correction </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">of the personal data that we hold about you. This enables you to have any incomplete or inaccurate data we hold about you corrected, though we may need to verify the accuracy of the new data you provide to us.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request erasure </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">of your personal data. This enables you to ask us to delete or remove personal data where there is no good reason for us continuing to process it. You also have the right to ask us to delete or remove your personal data where you have successfully exercised your right to object to processing (see below), where we may have processed your information unlawfully or where we are required to erase your personal data to comply with local law. Note, however, that we may not always be able to comply with your request of erasure for specific legal reasons which will be notified to you, if applicable, at the time of your request.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Object to processing </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">of your personal data where we are relying on a legitimate interest (or those of a third party) and there is something about your particular situation which makes you want to object to processing on this ground as you feel it impacts on your fundamental rights and freedoms. You also have the right to object where we are processing your personal data for direct marketing purposes. In some cases, we may demonstrate that we have compelling legitimate grounds to process your information which override your rights and freedoms.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request restriction of processing </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">of your personal data. This enables you to ask us to suspend the processing of your personal data in the following scenarios: (a) if you want us to establish the data&rsquo;s accuracy; (b) where our use of the data is unlawful but you do not want us to erase it; (c) where you need us to hold the data even if we no longer require it as you need it to establish, exercise or defend legal claims; or (d) you have objected to our use of your data but we need to verify whether we have overriding legitimate grounds to use it.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Request the transfer </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">of your personal data to you or to a third party. We will provide to you, or a third party you have chosen, your personal data in a structured, commonly used, machine-readable format. Note that this right only applies to automated information which you initially provided consent for us to use or where we used the information to perform a contract with you.</span></span></span></span></span></span></p>\r\n\r\n<p class=\"Default\" style=\"border: none;\"><span style=\"font-size: 11pt;\"><span style=\"font-family: \'Helvetica Neue\',serif;\"><span style=\"color: black;\"><strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">Withdraw consent at any time </span></span></span></strong><span style=\"font-size: 10.0pt;\"><span style=\"background: white;\"><span style=\"font-family: \'Helvetica\',\'sans-serif\';\">where we are relying on consent to process your personal data. However, this will not affect the lawfulness of any processing carried out before you withdraw your consent. If you withdraw your consent, we may not be able to provide certain products or services to you. We will advise you if this is the case at the time you withdraw your consent.</span></span></span></span></span></span></p>', NULL, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled', NULL, 1, 'privacy-policy', NULL, '2021-09-23 12:40:50', '2021-11-19 09:30:58');
INSERT INTO `dbs_pages` (`id`, `name`, `title`, `content`, `sections`, `meta_title`, `meta_keyword`, `meta_description`, `status`, `slugs`, `deleted_at`, `created_at`, `updated_at`) VALUES
(3, 'help', 'help', '<p>Office Share FAQ</p>\r\n\r\n<p>Office Share caters to both&nbsp;hosts who want to rent space/ property and to guests who are looking to rent great places.</p>\r\n\r\n<p>As a property manager running a vacation rental business, you first want to familiarize yourself with the community network platform. This is a great place to list your home&nbsp;if you are looking to easily rent your home or spare room to travelers. To get to know the website, your starting point should be the Airbnb&nbsp;</p>\r\n\r\n<p>&ldquo;Getting Started&rdquo; Section.&nbsp;<br />\r\nThis section will then allow you to visit subsections of how office share wrks How to Travel, and How to Host.</p>\r\n\r\n<p>As an owner/manager, the &ldquo;How to Host&rdquo; section will be your first interest, as it will guide you through how to complete a&nbsp;listing. However, you may want to check out the other sections that pertain to the travelers&nbsp;who are going to use the site for finding properties. This way you get a good idea of how they will use the site. Then you will be able to plan better on how to attract the people who are looking to travel and want to rent property.</p>\r\n\r\n<p>You will also find important information concerning how transactions are handled and protected. It will provide you with better insight to prepare your profile. There is also a lot of information that you will want to check out regarding the requirements&nbsp;for using the platform&nbsp;as an owner.</p>\r\n\r\n<p><br />\r\nHow to Become an Office Share Host</p>\r\n\r\n<p>The &ldquo;How to Host&rdquo; FAQ section will be specific to your search location. For example, if you are viewing this information from Canada then the information that Airbnb provides you with will be based on your region. When you arrive on the landing pages for&nbsp;hosts, it will provide you with all the information you need to know about hosting and it will allow you to register as a host. All of the details that you are going to need are collected here. It is easy for you to get started and to learn the basics, such as how money is handled in regards to the payments for your property. You have access to this information at all times when you are using Airbnb to rent your property.</p>\r\n\r\n<p>Airbnb FAQ&nbsp;for Guests: The Details</p>\r\n\r\n<p>Travelers looking for vacation rental listings find the&nbsp;platform easy to use. Though one area of the website that all travelers should take the time to review is the guest Airbnb FAQ section. When you click on this link in the&nbsp;help section, it will take you to a page with some additional choices for you to check out. These are Finding A Place, Booking A Place, Paying And Your Trip. In addition to this, you will want to check out the rules section for travelers.</p>\r\n\r\n<p>Finding a Place<br />\r\nThis section offers answers to frequently asked questions by travelers. The answers for doubts under this section will take you to pages that are full of detailed and applicable information. This information is always available, so you can check it out any time day or night that you want.<br />\r\nBooking a Place and Paying</p>\r\n\r\n<p>This section will give you some additional answers to queries&nbsp;which ensure you completely understand how to use the platform. It contains exactly what you need to know in order to book the trip&nbsp;accommodation of your choice using the platform.<br />\r\nYour Airbnb Trip<br />\r\nThis section is particularly helpful for first-time&nbsp;travelers. It answers all travelers&rsquo; basic doubts. Not only will it help you to plan your trip, but it will also help you deal with some common circumstances that can arise like changing your plans or problem-solving. There are plenty of opportunities to find a house&nbsp;through this community platform. This is one of the reasons you want to become totally familiar with it before renting a place.<br />\r\nGeneral&nbsp;FAQ Information<br />\r\nAside from there being the specific topics that are applicable to both hosts and travelers, there are many different sections to provide general information. On each page, there is usually an additional number of topics that you may be interested in checking out.<br />\r\nIn the main sidebar of the FAQ section, there is an entire list of additional topics that are important for you to review. These are topics such as host guarantee, airbnb taxes&nbsp;and policies, just to name a few.<br />\r\nIf you are having difficulty finding exactly what you are looking for, then there is a search option available for you. At the top of most pages within the Airbnb FAQ network section there is a &ldquo;How Can We Help&rdquo; search bar where you can type in any specific queries or keywords.</p>\r\n\r\n', NULL, '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', NULL, 1, 'help', NULL, '2021-09-23 12:42:49', '2021-09-23 12:42:49'),
