(7, 'faq', 'faq', '<p>FAQs</p>\r\n\r\n<p>While the OS platform is pretty intuitive to use, and we hope we&rsquo;ve built something that deals with most eventualities we also get asked the same questions quite a lot&hellip;so here they are with some answers and advice from our Chief Sharing Officer.</p>\r\n\r\n<p>Getting signed up</p>\r\n\r\n<p>Q. I have been declined at the on-boarding stage. How do I find out why?</p>\r\n\r\n<p>Q. I am having issues with my OTP (one time password)?</p>\r\n\r\n<p>Q. Do I need to have Cookies enabled to make the Join process work?</p>\r\n\r\n<p>Q. Do I need to be a User to list a property or space? Booking Confirmations</p>\r\n\r\n<p>Q. If a booking can&rsquo;t be made immediately and needs Host confirmation, how quickly will I get a response.</p>\r\n\r\n<p>Q. How will I know a booking is secure? &nbsp;</p>\r\n\r\n<p>Q. Is there a maximum number of weeks I can book for in one location, or a cap on cost? Cancelling a Booking</p>\r\n\r\n<p>Q. Can I cancel a booking</p>\r\n\r\n<p>Q. What if I have made a mistake with a booking, where can I get help?</p>\r\n\r\n<p>Q. Where can I find the full cancellation policy? Payments</p>\r\n\r\n<p>Q. How will OS show up on my bank statements?</p>\r\n\r\n<p>Q. Can I get a copy of an invoice?</p>\r\n\r\n<p>Q. How often will I be charged?</p>\r\n\r\n<p>Q. What happens if I stop a payment?</p>\r\n\r\n<p>Q. Can I set up a Direct Debit ? Charges</p>\r\n\r\n<p>Q. How does OS make its money</p>\r\n\r\n<p>Q. How much money does OS charge for its services What to expect when you arrive.</p>\r\n\r\n<p>Q. What do I need to do when I get to a location?</p>\r\n\r\n<p>Q. Do I need ID?</p>\r\n\r\n<p>Q. What do I do if a Host property is not accessible?</p>\r\n\r\n<p>Q. What time can I enter and when must I leave by?</p>\r\n\r\n<p>Q. Are there any special considerations for out of hours working? Long term Bookings</p>\r\n\r\n<p>Q. Can I enter into a long term relationship with the Host to stay?</p>\r\n\r\n<p>Q. What does OS class as long-term or permanent</p>\r\n\r\n<p>Q. Can OS execute these arrangements? Issues and Complaints</p>\r\n\r\n<p>Q. How do I make a complaint about a stay</p>\r\n\r\n<p>Q. How do I make a complaint about a host</p>\r\n\r\n<p>Q. Are there House rules?</p>\r\n\r\n<p>Q. Do you offer arbitration or legal support to Hosts and Sharers Accessibility</p>\r\n\r\n<p>Q. Can I view property access for disabled people. Privacy and Security</p>\r\n\r\n<p>Q. What do you do with my data?</p>\r\n\r\n<p>Q. Will you sell my data?</p>\r\n\r\n<p>Q. When I cancel my membership is my data and account history deleted.</p>\r\n\r\n<p>Q. Are my chats monitored</p>\r\n\r\n<p>Q. Where in the world are the OS servers Listing a Property / Space</p>\r\n\r\n<p>Q. Is there a minimum requirement for a listing?</p>\r\n\r\n<p>Q. Do I need extra insurance to cover third parties?</p>\r\n\r\n<p>Q. Will I need to tell my Landlord?</p>\r\n\r\n<p>Q. Who is the contract between?</p>\r\n\r\n<p>Q. Am I personally responsible for the services being offered?</p>\r\n\r\n<p>Q. Does this effect my business rates?</p>\r\n\r\n<p>Q What if I need to cancel a booking or make a mistake with availability?</p>\r\n\r\n<p>Q. Is there a support number for help with listings?</p>\r\n\r\n<p>Q. Why do I have to wait for a listing to be Approved?</p>\r\n\r\n<p>Q. Way has my listing been rejected?</p>\r\n\r\n<p>Q. Why has my Space been delisted?</p>\r\n\r\n<p>Q. Am I bound into a long term contract with OS to list my space exclusively though it? Q. When I list too many spaces on my subscription will I be automatically changed for the next tier in the OS Plan? The Office share Verified Scheme</p>\r\n\r\n<p>Q. What is OS Verified?</p>\r\n\r\n<p>Q. How do I get my space verified and what does it cost? Hosting</p>\r\n\r\n<p>Q. How do I get started?</p>\r\n\r\n<p>Q. How do I increased the attractiveness of my space to the OS community?</p>\r\n\r\n<p>Q. Does a property have to be occupied to be shared?</p>\r\n\r\n<p>Q. Should I ask for ID?</p>\r\n\r\n<p>Q. Can I have my own house rules?</p>\r\n\r\n<p>Q. Do I have to be available the chat?</p>\r\n\r\n<p>Q. How do I manage my space availability? Ratings</p>\r\n\r\n<p>Q. Who moderates the ratings?</p>\r\n\r\n<p>Q. What can I do if my ratings are bad or someone has damaged my rating, is there recourse.</p>\r\n\r\n<p>Q. Does OS indemnify me against a bad experience</p>\r\n\r\n<p>Q. How does office share verify the ratings</p>', NULL, 'faq', 'faq', NULL, 1, 'faq', NULL, '2021-12-21 11:52:53', '2021-12-21 11:52:53'),
