INSERT INTO `dbs_property` (`id`, `user_id`, `property_title`, `short_description`, `total_desk`, `thumbnail`, `gallary_image`, `is_approved`, `booking_approval`, `avg_rating`, `price_from`, `price_to`, `availability_type`, `created_at`, `updated_at`) VALUES
(1, 134, 'Mare Street Studios', '<p>Sophisticated high-rise modern buildings built above the famous Mare Street Studios of House of Cards fame. A very well known location within a stone throw of the corridors of power, this building was once the HQ of the Anglo Iranian Oil Company. Join technology, investment and commodity trading business who benefit from the Gigabit networks rooted to all floors. All rooms have access to facilities 24 hours bookable through the floor receptions. Fully access controlled 24/365, this property is geared for businesses who see infrastructure resilience as paramount.</p>', 18, '611362e96dc2410.jpg', '[\"Matrix-final(1).jpg\"]', 'publish', 1, 4, 10, 10, 1, '2021-08-11 05:40:57', '2022-01-04 12:50:45'),
(60, 388, 'Da Vinci House', 'A unique bright, contemporary and open plan space made to encourage a friendly collaborative environment.\r\n\r\nThis subterranean office space in Farringdon was designed and fitted out by E&A Securities, a business known for developing the highest quality spaces in unique locations.  \r\n\r\nFitted with a coffee bar, long hot-desking areas, break-out spaces and high-tech dedicated meeting rooms this venue is a fabulous setting for keynote meetings and city desk days. \r\n\r\nIdeally situated for both sides of town Da Vinci House is all of 300m from Farringdon Station and the amenities that have popped up around it.', 147, '6156c7380a283EA_Iceni Timelapse-low.gif', '[\"EA_Iceni Timelapse-low.gif\",\"Outside.jpg\",\"Hot Box Front.jpg\",\"e_JDD4175_edited.jpg\",\"e_JDD4147_edited.jpg\",\"e_JDD4117_edited.jpg\",\"e_JDD4075_edited.jpg\",\"e_JDD4063_edited.jpg\",\"e_JDD4054_edited.jpg\",\"Bill Sykes.jpg\"]', 'publish', 1, 5, 9, 20, 3, '2021-10-01 08:30:48', '2021-12-23 06:03:09'),
(102, 386, '25 Horsell Road', 'A vibrant space offering both co-working and private offices in an excellent location with great transport links...\r\n\r\nThis building is home to different types of businesses, who are all able to connect and collaborate with a wide network of liken minded individuals. The work space modern and fresh with various amenities to suit comprehensive business and individual requirements including phone booths, a coffee lounge, stock kitchenettes and out door space for a breath of fresh air.', 22, '61658916d24ecScreenshot 2021-10-12 at 14.06.41.png', '[\"Screenshot 2021-10-12 at 14.07.01.png\"]', 'publish', 1, 0, 10, 72, 3, '2021-10-12 13:09:42', '2021-10-22 07:09:33'),
(104, 427, '14 Rosebery Avenue', 'Spacious offices within a converted warehouse in the heart of Clerkenwell, ideal for both freelancers and established businesses.\r\n\r\nThis building is a former 20th century warehouse converted into bright and airy co-working spaces and private offices over two floors and a mezzanine level. In addition to onsite amenities this space also offers business support to help companies grow.', 235, '61658e515fa1fScreenshot 2021-10-12 at 14.29.14.png', '[\"Screenshot 2021-10-12 at 14.29.25.png\"]', 'publish', 1, 0, 5, 100, 3, '2021-10-12 13:32:01', '2021-10-28 08:52:16'),
