(107, 379, 'Kreativ House', 'Lorem ipsum dolor sit amet, iuvaret temporibus ad mea, amet diceret omittam eos ad. Vix augue commodo repudiandae ea, duo harum maiorum ea. Vocent constituam sit cu, sit impetus offendit dissentias ne. Possim definitiones cu quo, an everti phaedrum mediocritatem eum. Hinc possit id eam, an corrumpit molestiae constituto per. Augue quaeque imperdiet te sit.', 20, '6165987ff02bbScreenshot 2021-10-12 at 15.13.33.png', '[\"Screenshot 2021-10-12 at 15.13.37.png\",\"Screenshot 2021-10-12 at 15.13.42.png\",\"Screenshot 2021-10-12 at 15.13.47.png\",\"Screenshot 2021-10-12 at 15.13.52.png\",\"Screenshot 2021-10-12 at 15.13.57.png\"]', 'publish', 1, 0, 14, 14, 3, '2021-10-12 14:15:27', '2021-10-22 07:11:09'),
(108, 379, '1 Neal Street', 'Large, modern offices flooded with natural light in one of London\'s most sought after locations.\r\n\r\nThis is a newly renovated building offering self contained office space fit for various business types and sizes. There are large kitchen areas and breakout spaces making it easy for professionals to network and collaborate.', 28, '61659c735a487Screenshot 2021-10-12 at 15.28.57.png', '[\"Screenshot 2021-10-12 at 15.29.04.png\",\"Screenshot 2021-10-12 at 15.29.12.png\",\"Screenshot 2021-10-12 at 15.29.18.png\",\"Screenshot 2021-10-12 at 15.29.28.png\"]', 'publish', 0, 0, 10, 70, 3, '2021-10-12 14:32:19', '2021-11-10 07:30:10'),
(130, 380, 'The Eoxys House1', '<p>TEST3 test tests</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Test</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Test</p>', 290, '61ad9c3622dd402.png', '[\"3e907085-9f8b-4b30-b51e-303625e7aa98-0.jpeg\",\"4ba27d08-8676-4737-a2fc-0e46aa3f114a-0.jpeg\",\"48bcc2f3-e51b-4e57-bcce-f02893f7dd54-0.jpeg\",\"323728cf-93c1-439d-9707-1887ee164f56-0.jpeg\"]', 'publish', 0, 5, 5, 16, 3, '2021-10-22 04:46:02', '2022-01-13 12:15:58'),
(136, 244, 'Leeds Office demo202', 'Lorem ipsum', 0, '618b57470a7891.png', '[\"61822ea53e8aaClearance-sale-90.jpg\",\"61822ea53e9a0driving-licence2.jpg\",\"61822ea53ea8eimage_2021_10_05T10_12_12_895Z.png\",\"61822ea53ecfeios-11-3840x2160-4k-5k-beach-ocean-13655.jpg\",\"61822ea53f313ODL_Eng_Full_Back.jpg\",\"61822ea53f777processed.jpeg\"]', 'pending', 0, 0, 0, 0, 1, '2021-10-29 12:29:40', '2021-11-10 05:23:19'),
(148, 244, 'Leeds Office demo202', 'Lorem ipsum', 0, '618bca96a729fcall.png', '[\"618bca96a7741_call.png\",\"9a6dfd17-5817-4cfa-9403-55ec47d468d1-0.jpeg\"]', 'pending', 0, 0, 0, 0, 1, '2021-11-10 13:35:09', '2021-11-10 13:35:18'),
(149, 428, 'Fifteen, Colmore Row', 'Fifteen Colmore Row provides timeless grade \'A\' office accommodation. The prominent six storey building offers prime accommodation opportunities in Birmingham city centre. Carefully designed to blend with Colmore Row\'s heritage and period architecture, Fifteen Colmore Row\'s curved exterior finished in Bath Stone, projects a distinguished frontage from its prominent corner position. The main entrance and reception have been refurbished recently to a high standard to create a first class sense of arrival for staff and clients.\r\n\r\nFifteen Colmore Row comprises the following specification:\r\n\r\n- Comfort Cooling\r\n- Raised access floor\r\n- Suspended ceilings\r\n- LG7 compatible lighting\r\n- Refurbished male and female WCs and showers\r\n- Concierge reception\r\n- Secure bicycle parking\r\n- EPC Rating C', 0, '6177bbd7099a21d3b087a-e646-49f1-b60d-3377077481b1-0.jpeg', '[\"1d3b087a-e646-49f1-b60d-3377077481b1-0.jpeg\",\"5d2f3e3e-7a55-4361-931f-b6b28caeac54-0.jpeg\",\"6ea40a66-7089-49c3-bffb-c75c8454f839-0.jpeg\",\"7bb1994a-8e7e-499a-8d86-83faa154c7d2-0.jpeg\",\"82bdf93f-9d87-4f10-a41c-80f187ba0253-0.jpeg\",\"7071c78a-74d9-42b3-bd72-a198991397a6-0.jpeg\"]', 'publish', 0, 0, 0, 0, 1, '2021-10-26 08:27:03', '2021-10-27 13:00:31'),
(150, 418, 'Maybrook House', 'Maybrook House offers a professional working environment within a key city centre location.', 0, '6177bf783faad4ba27d08-8676-4737-a2fc-0e46aa3f114a-0.jpeg', '[\"3e907085-9f8b-4b30-b51e-303625e7aa98-0.jpeg\",\"4ba27d08-8676-4737-a2fc-0e46aa3f114a-0.jpeg\",\"48bcc2f3-e51b-4e57-bcce-f02893f7dd54-0.jpeg\",\"323728cf-93c1-439d-9707-1887ee164f56-0.jpeg\"]', 'publish', 0, 0, 0, 0, 1, '2021-10-26 08:42:32', '2021-10-26 08:42:36'),
(164, 428, 'Pacific House', 'The office accommodation provides the following specification:\r\n\r\n• Manned reception\r\n• 2 x 10 person passenger lifts\r\n• 2 showers per floor\r\n• DDA Compliant\r\n• LED Lighting\r\n• Extensive Secure Basement Car Parking\r\n• 5th Floor offers fully fitted / ready of occupy space with the benefit of:\r\no 81 Desks\r\no 8 Meeting Rooms\r\no Comfort Cooling\r\no Cat5e Cabling\r\no Full Itinerary Available on Request.', 44, '617a64542257c548520f0-b635-44df-a6e2-4df8ac7233fd-0.jpeg', '[\"01ff26e2-9fc2-45b9-b7d7-18ac77d194f6-0.jpeg\",\"5e76a593-b707-4308-a83a-2ce7dba05848-0.jpeg\",\"54120b7f-5e3d-4669-b907-9a42e44c3e8e-0.jpeg\",\"548520f0-b635-44df-a6e2-4df8ac7233fd-0.jpeg\",\"26208333-7a9e-431b-bb8c-ae20ad74db7d-0.jpeg\",\"ebd0edfd-f77b-4bd5-971d-5ece54a4f44e-0.jpeg\"]', 'publish', 0, 0, 14, 14, 3, '2021-10-28 08:50:28', '2021-10-28 08:52:09'),
(165, 427, 'Libertas House', 'Glasgow Central and Queen Street Railway Stations are located within short walking distance along with Buchanan Street subway and the Glasgow Airport Bus Link.\r\n\r\nThe accommodation benefits from the following specification:\r\n\r\n• 2 passenger lifts\r\n• Raised access floors\r\n• Central lightwell\r\n• Secured garaged car parking availability\r\n• Bike racks\r\n• Showers\r\n• Air conditioning\r\n• Disabled access from the rear lane\r\n• Commissionaire manned reception\r\n• Some suites benefit from existing fit out including meeting rooms, kitchens and cabling', 60, '617a663c69f9e4e0f54eb-9d62-4d91-9e5f-075ee998689f-0.jpeg', '[\"4e0f54eb-9d62-4d91-9e5f-075ee998689f-0.jpeg\",\"04433b2c-27f4-4022-87e5-bbf4d4060510-0.jpeg\",\"064982a3-f9f2-4fbe-8c18-7c4ffa5331f9-0.jpeg\",\"d2b7a897-bbef-4943-8eb5-d95d413f80e1-0.jpeg\",\"da9c2ad3-1128-4104-ba1f-af5acdbd8974-0.jpeg\",\"f9f9928b-da6a-405d-9c9a-a628ab291594-0.jpeg\"]', 'publish', 0, 0, 22, 22, 3, '2021-10-28 08:58:36', '2021-10-28 09:18:49'),
(166, 418, 'The Royals', 'The Royals comprises an impressive modern Grade A office building arranged over ground and four upper floors located in the heart of South Manchester.\r\n\r\nThe building is of steel frame construction with brick pillars and glazed cladding.\r\n\r\nInternally the building features a recently refurbished reception area and a service core with two 10 person lifts. The flexible open plan accommodation benefits from full height glazing, raised access floors and suspended ceilings incorporating recessed lighting.', 28, '617a69440dfc98afbb547-365d-451e-8ee2-ad6d18693d23-0.jpeg', '[\"8afbb547-365d-451e-8ee2-ad6d18693d23-0.jpeg\",\"62cbf76d-6ab8-45e3-a9bb-6bcb1778d065-0.jpeg\",\"e48d4925-04cb-4e50-804d-ce189e31f5b0-0.jpeg\"]', 'publish', 0, 0, 11, 16, 3, '2021-10-28 09:11:32', '2021-10-28 09:18:45'),
(167, 418, 'No.2 Circle Square', 'Coworking, serviced space, made & managed, leased\r\n\r\nKey features:\r\n\r\n● Contemporary exposed soffit details and air conditioning to ceilings with pendant LED lighting\r\n● Typical floor to ceiling heights of 2.9m to 3.8m\r\n● BREEAM Rating \"Excellent\" and target EPC \"A\"\r\n● WiredScore Platinum certified for digital connectivity\r\n● 24/7 access with full concierge and business support\r\n● Symphony Park - unique to the city centre\r\n● Walking distance to major transport hubs\r\n● 150 person auditorium and meeting facilities\r\n● Lounge and informal event spaces\r\n● 42 Showers, lockers and changing rooms\r\n● Secure storage for 386 bikes\r\n● Social, health and wellbeing events\r\n● Business support programmes\r\n● On-site multi-storey car park\r\n\r\nProperty type\r\nOffice', 140, '617a6bc769c7a84b63621-5154-435f-9ef3-5ed0c80d6126-0.jpeg', '[\"0f06b5b9-df45-45bf-8dd7-ce8241e89c1a-0.jpeg\",\"2e6a8ac5-cacb-4ef4-9c76-631c208abe9c-0.jpeg\",\"84b63621-5154-435f-9ef3-5ed0c80d6126-0.jpeg\",\"857ff581-48ee-476f-9602-3aebcf0db0d9-0.jpeg\",\"38807c4e-0e90-494d-95db-dbbd44260ff2-0.jpeg\",\"5982095d-1733-4e5e-94ba-98e09b435691-0.jpeg\",\"ab90bfee-e69b-4a53-aaf6-2a21f417f161-0.jpeg\"]', 'publish', 0, 0, 16, 16, 3, '2021-10-28 09:22:15', '2021-10-28 09:24:09'),
(168, 427, 'Eagle 2 Birmingham', 'Eagle 2 provides a highly specified office building designed to meet the highest standards and requirements.\r\n- Car Parking Ratio of 1: 240 sq ft\r\n- Central entrance with triple height glazed reception.\r\n- Comfort Cooling\r\n- Suspended ceilings with recessed LG7 lighting\r\n- Four 10 person passenger lifts\r\nBREEAM rating of \'very good\'', 420, '617a6e9001ed3c3cdb24e-52ea-423f-808b-5d066a6860c7-0.jpeg', '[\"5a19f954-0491-43cc-9179-2679f3b0a2bd-0.jpeg\",\"5fb0a239-1954-4822-a5f0-7483802c1242-0.jpeg\",\"8ee6f6ef-da40-4947-afa4-7dee00702065-0.jpeg\",\"398a5b3f-d4b3-4845-9422-5c0fd29b53d8-0.jpeg\",\"3665d5b0-7a31-4336-9c25-ced1c6f9c409-0.jpeg\",\"c3cdb24e-52ea-423f-808b-5d066a6860c7-0.jpeg\",\"c64c4e71-d992-404a-bd3d-a2f79694a855-0.jpeg\",\"dda4e1c8-6001-4a28-babd-095ef9a7462c-0.jpeg\",\"f8ac5dbc-2dcd-4f57-807d-e8f46e45a651-0.jpeg\"]', 'publish', 0, 0, 11, 16, 3, '2021-10-28 09:34:08', '2021-10-28 09:37:59'),
