INSERT INTO `dbs_property_extra_details` (`id`, `property_id`, `disability_access`, `how_to_find_us`, `insurance`, `covid_19_secure`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'We like people and understand that happy, connected, safe people are productive. And of course they come back.\r\nOur ethos is simple, we make your stay enjoyable and treat you as if you are part of the family.', '20M Public liability', 'Part of the benefit of being in the Mike Ashley Property Group is our access to their world class laundry team.', '2021-08-11 00:00:00', '2021-10-12 16:24:49'),
(22, 40, 0, 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.', 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.', 'Lorem ipsum, or lipsum as it is sometimes known, is dummy text used in laying out print, graphic or web designs.', '2021-09-08 10:11:20', '2021-09-08 10:11:20'),
(41, 60, 1, 'At Iceni Projects we believe that everything we do is ultimately about people – and as a consultancy operating within the built environment, for people read place. A place to live, to work, to play. To grow up; to grow old. A sense of place. Everything in its place. A time and a place.\r\n\r\nWe are fortunate at Iceni to be able to call upon colleagues with a myriad of qualifications, specialisms and backgrounds, from archaeology to transport, operating across the country from four world class cities. However, what links us all is the belief that we can create better places by working collectively and collaboratively. So whether you choose to work with one individual or many, a planner or sustainability consultant, we put a commitment to place at the heart of what we do.\r\n\r\nWe firmly believe in the principles of sustainable development. We practice what we preach. We are committed to reducing our environmental impact and enhancing our contribution to society through a series of relevant targets that are regularly reviewed, monitored and updated. You can read more about our Environmental and Sustainability Policy here', 'Yep', 'Nope', '2021-10-01 08:30:48', '2021-10-12 14:16:43'),
